VALUES
	(1,'Kurz Testing','Kurz Testing','Testing course','Курс Тестинг','testing','Během pár hodin dostanete základní úvod do oborů IT a testování. \r\nPo teoretickém úvodu si práci testera rovnou prakticky vyzkoušíte.\r\nKurz probíhá pouze v českém jazyce.','Během pár hodin dostanete základní úvod do oborů IT a testování. \r\nPo teoretickém úvodu si práci testera rovnou prakticky vyzkoušíte.\r\nKurz probíhá pouze v českém jazyce.','In just a few hours you’ll be introduced\r\nto IT and testing on a basic level.\r\nAnd after covering initial theory, you’ll try the tester’s job in practice.\r\nThe course is only available in the Czech language.','В течение пары часов Вы получите \r\nосновные знания в IT-сфере и тестировании программного обеспечения.\r\nПосле введения в теорию Вы можете на практике попробовать работу тестировщиком.\r\nКурс доступен только на чешском языке.','Praha','Praha','Prague','Прага',4000,4000,3000,3000,'2 × 4 hod','2 × 4 hod','2 x 4 hours','2 раза по 4 часа',43,'','testing','testing-course','testing',NULL,NULL,NULL,42,NULL,'Nauč se pracovat v IT jako tester. Staň se IT expertem a dělej jednu z nejpoptávanějších pozic na trhu.','Nauč se pracovat v IT jako tester. Staň se IT expertem a dělej jednu z nejpoptávanějších pozic na trhu.',NULL,NULL,'Základní kurz na pozici Tester — Acamar','Základní kurz na pozici Tester — Acamar',NULL,NULL),
	(2,'Kurz SQL','Kurz SQL','SQL course','Курс SQL','zaklady-sql','IT obory operují se spoustou dat. Naučíme vás se v nich vyznat a pracovat s nimi. Osaháte si zacházení s databázemi a získáte výhodu oproti jiným testerům. Kurz probíhá pouze v českém jazyce.','IT obory operují se spoustou dat. Naučíme vás se v nich vyznat a pracovat s nimi. Osaháte si zacházení s databázemi a získáte výhodu oproti jiným testerům. Kurz probíhá pouze v českém jazyce.','IT disciplines work with lots of data.\r\nWe’ll show you how to understand and work with it.\r\nYou’ll have an opportunity to work with databases and gain a competitive edge on the labour market.\r\nThe course is only available in the Czech language.','IT-специальности связаны с большим количеством данных.\r\nМы научим Вас в них разбираться и работать с ними.\r\nВы поработаете с базой данных и получите дополнительное преимущество на рынке труда.\r\nКурс доступен только на чешском языке.','Praha','Praha','Prague','Прага',4000,4000,3000,3000,'2 × 4 hod','2 × 4 hod','2 x 4 hours','2 раза по 4 часа',45,'','zaklady-sql','sql-course','sql',NULL,NULL,NULL,44,NULL,'Nauč se pracovat v IT jako specialista na data v SQL. Staň se IT expertem a dělej jednu z nejpoptávanějších pozic na trhu.','Nauč se pracovat v IT jako specialista na data v SQL. Staň se IT expertem a dělej jednu z nejpoptávanějších pozic na trhu.',NULL,NULL,'Kurz práce s SQL databázemi — Acamar','Kurz práce s SQL databázemi — Acamar',NULL,NULL),
	(3,'Kurz Web Services','Kurz Web Services','Web Services course','Курс Web Services','web-services','Na webové služby jako tester brzy narazíte. V programování znamenají velký trend. Vysvětlíme vám principy HTTP na příkladech a naučíme vás pracovat s nástrojem SoapUI. Kurz probíhá pouze v českém jazyce.','Na webové služby jako tester brzy narazíte. V programování znamenají velký trend. Vysvětlíme vám principy HTTP na příkladech a naučíme vás pracovat s nástrojem SoapUI. Kurz probíhá pouze v českém jazyce.','As a tester, you’re bound to come across web services soon. They’re a huge trend in coding.\r\nWe’ll introduce and explain the principles of HTTP with examples and you’ll get familiar with SoapUI technology.\r\nThe course is only available in the Czech language.','В качестве тестировщка Вы быстро найдёте ранообразные веб-сервисы. В программировании они очень популярны. \r\nМы объясним Вам принципы HTTP на примерах и Вы погрузитесь в технологии SoapUI.\r\nКурс доступен только на чешском языке.','Praha','Praha','Prague','Прага',2500,2500,3000,3000,'1 × 4 hod','1 × 4 hod','2 x 4 hours','2 раза по 4 часа',47,'','web-services','web-services-course','web-services',NULL,NULL,NULL,46,NULL,'Nauč se pracovat v IT jako tester webových služeb. Staň se IT expertem a dělej jednu z nejpoptávanějších pozic na trhu.','Nauč se pracovat v IT jako tester webových služeb. Staň se IT expertem a dělej jednu z nejpoptávanějších pozic na trhu.',NULL,NULL,'Kurz pro testery webových služeb — Acamar','Kurz pro testery webových služeb — Acamar',NULL,NULL),
	(4,'Kompletní příprava pro testery','Kompletní příprava pro testery','Complete preparation for testers','Полная подготовка для тестировщиков','kompletni-priprava-pro-testery','Nemáte zatím žádné znalosti o IT? Pro vás je určený zvýhodněný plný balíček. Získáte testerské základy i něco navíc. Jako bonus vás připravíme na pohovor do IT firmy. Kurz probíhá pouze v českém jazyce.','Nemáte zatím žádné znalosti o IT? Pro vás je určený zvýhodněný plný balíček. Získáte testerské základy i něco navíc. Jako bonus vás připravíme na pohovor do IT firmy. Kurz probíhá pouze v českém jazyce.','You don’t know anything about IT yet? We’ve created a three-part course for you.\r\nMaster testing basics and even a bit more. As a bonus, we’ll prepare you for an interview at an IT company.\r\nThe course is only available in the Czech language.','У Вас пока нет знаний в IT-области? Для Вас подойдёт обучение, включающее все 3 курса.\r\nВы получите основные знания о тестировании программного обеспечения и дополнительные знания в этой области. В качестве бонуса мы обеспечиваем подготовку на собеседование в IT-фирму. Курс доступен только на чешском языке.','Praha','Praha','Prague','Прага',9000,9000,7000,7000,'6 × 4 hod','6 × 4 hod','2 x 4 hours','2 раза по 4 часа',49,'','kompletni-priprava-pro-testery','complete-preparation-testers','polnaya-podgotovka-dlya-testirovshikov',NULL,NULL,NULL,48,NULL,'Komplexní kurz, který Tě připraví na perspektivní kariéru IT specialisty — testera. Staň se žádným IT expertem.','Komplexní kurz, který Tě připraví na perspektivní kariéru IT specialisty — testera. Staň se žádným IT expertem.',NULL,NULL,'Nauč se pracovat jako tester od A do Z — Acamar','Nauč se pracovat jako tester od A do Z — Acamar',NULL,NULL),
