	(73,'Jakub Bitman','737621443','Očekávám novou zkušenost, nové znalosti z oblasti, která mě baví a kterou aktivně sám využívám. Jako profesionální sportovec rád hledám nové výzvy.','cv/f510b08e0243ea311f0c89a6f22cb254/CV_Jakub_BITMAN_fin.pdf','2019-09-09 08:52:34','jakubbitman@gmail.com'),
	(74,'Daniel Rážek','732754350','Dobrý den, \r\nřeším kariérní změnu - 12 let podnikám a dělám obchod v různých oborech - telekomunikace, finance, farmacie, eventy i IT (dělali jsme webové stránky i e-shopy klientům), já jsem byl vždy v roli obchodníka, projekťáka a u některých projeků i CEO (eventy a webdesignové studio). \r\n\r\nJe to rok co mám rodinu a cítím, že bych měl a asi i chtěl zvolnit a mít klidnější práci od-do. Kamarád díky Vám dělá senior testera a je spokojený. Myslí si, že ta práce mě moc bavit nebude, tak bych chtěl právě zjistit co vše práce obnáší a proto jsem se rozhodl přihlásit na kurz. Pokud bych usoudil, že to pro mě je, kurz bych dokončil celý i vč. těch navazujících.\r\n\r\nDěkuji za odpověď\r\nZdraví\r\nDaniel Rážek\r\n\r\nP.S.: CV zkusím aktualizovat, dlouho jsem jej nepotřeboval. :)','','2019-09-09 10:18:01','razek@delab.cz'),
	(75,'Nicole Wiedermannová','+420555658789','Přihláška, zkouška','','2019-09-12 07:17:17','nikolka@acamar.cz'),
	(76,'Šárka Dort','721954799','Ahoj,\r\ntoto je test pls koukni jestli nepřišlo do SPAMU :)\r\n\r\nŠ.','','2019-09-12 08:40:35','blahovcovas@gmail.com'),
	(77,'Jakub Malý','+420687954125','Achjo','','2019-09-12 13:25:44','kuksem@kuktam.cz'),
	(78,'Lukáš Gajarský','+421949692564','Som lektor cudzích jazykov, no postupne by som chcel zmeniť odbor. Nemám s IT doteraz skúsenosti, som len bežný používateľ počítačových programov a testing podľa všetkého by mal byť najľahšou vstupnou bránou, preto som si tento kruz vybral. Som však samostatný a viem sa učiť sám, no potrebujem niekoho na ukázanie cesty...','','2019-09-12 13:26:08','lukas.gajarsky@gmail.com'),
	(79,'Josef Tichý','606576033','','cv/34ca05cb7f99f89c64558197d8c866eb/CV-Tichý.pdf','2019-09-15 07:57:33','tichyjosef@spojenci.cz'),
	(80,'Pavel Šimek','+420777789968','Dobrý den, rád bych změnil kariéru a vrhnul se do IT, termíny mě bohužel nevyhovuje (čtvrtky nemohu). Je nějaké jiné řešení? Děkuji\r\nPavel Šimek','cv/6045fa49df62ba38b15229f16258e014/zivotopis.pdf','2019-09-16 10:10:22','xsimekp1@gmail.com'),
	(81,'Jozef Pavel','608783258','najst si novou práci v IT a byt dobrým študentom Vašeho kurzu','cv/58dc5a2d4bbe42a5537b1f29ed4f649e/CV_Pavel_SK.pdf','2019-09-19 06:00:36','jojo.pavel@gmail.com'),
	(82,'Terezia Gondova','+420 792 434 300','- rada by som z kurzu odisla s poznatkom ako sa vyuziva nastroj SOAPUI pre testovanie, idealne prakticky','cv/0ca59dae41aa70be628a54947d3aa473/Gondova_CV.pdf','2019-09-26 09:57:10','terezia.gondova@gmail.com'),
	(83,'Margarita Kepich','774130748','','','2019-10-01 12:05:30','margaritakepich@outlook.com'),
	(84,'Lukáš Gajarský','+421949692564','Dobrý deň, už mám u Vás absolvovaný prvý kurz - testování a chcel by som absolvovať zvyšné - sql a web services (teda aj ten posledný - príprava na pohovor, len nejde mi to zakliknúť). Ďakujem pekne.','','2019-10-06 14:53:55','lukas.gajarsky@gmail.com'),
