	(98,'Michael Orlíček','+420 722431222','Dobrý den,\r\nrád bych se naučil testovat, protože se chci stát testerem. Pokud by byl ještě listopadový termín, byl bych za něj rád, protože jsem ještě na ÚP.\r\nPřeji hezký den\r\nMichael Orlíček','cv/154cec18e44cc559756e99ad370b10b5/cv_michael_orlicek.doc','2019-11-18 10:27:26','michael.orlicek@seznam.cz'),
	(99,'Daniel Suk','608123497','Očekávám, že by tento kurz mohl být prvním krokem ke změně kariéry a novému životu. Snažím se o vstup do IT a věřím, že právě testování by mohla být správná volba.','cv/510b8104c7fcd3437795b685862a9da4/Zivotopis_DanielSuk.pdf','2019-12-13 09:58:41','suk.daniel1@gmail.com'),
