VALUES
	(842,'2018-10-19 13:39:21','Pilsen','ASAP','Java Developer – IoT Solutions','<p>Our customer develops solutions for vehicle connectivity, smart mobility and/or remote diagnostics that are used in buses, trucks and passenger cars. Besides that, it develops open and individual concepts that provide intelligent connectivity solutions in telematics, asset tracking, entertainment, diagnostics and engineering.</p>\r\n<p>We seek both Junior and Mid/Senior Java Developers willing to build software solutions in modern technologies within a friendly atmosphere. These software solutions are used worldwide &ndash; from Germany to Hong-Kong and Australia to Sweden.&nbsp;</p>','Responsibilities:','<ul>\r\n<li>Requirement analysis</li>\r\n<li>Solution design and programming</li>\r\n<li>Participation in all phases of development lifecycle</li>\r\n<li>Writing documentation and keeping it up-to-date</li>\r\n</ul>','Required experience:','<ul>\r\n<li>Java SE/2EE</li>\r\n<li>Spring Boot, Hibernate, Docker Swarm</li>\r\n<li>Microsoft Azure, Microservice Architecture, REST API Services</li>\r\n<li>Maven, GIT, Nexus, Jenkins, Jira, SCRUM, Confluence</li>\r\n<li>SQL knowledge</li>\r\n<li>Good English</li>\r\n</ul>','What we would appreciate:','<ul>\r\n<li>NoSQL databases experience</li>\r\n<li>Kubernetes&nbsp;</li>\r\n<li>Active Directory</li>\r\n<li>IoT experience</li>\r\n</ul>','','','','','','','tereza.jarolimkova@acamar.cz','Tereza','Jarolímková','1547127338_teranasirku.png','https://old2018.acamar.cz/admin/users/images/1547127338_teranasirku.png','+420 725 512 351','Senior Recruiter',1,'cs','java-developer-iot-solutions',811),
	(847,'2018-10-10 11:15:32','Praha','Dle domluvy','','','','','','','','','','','','','','','Marta.maresova@adastragrp.com','Marta','Marešová','1529658364_KopeckáMartafotonašířku.png','https://old2018.acamar.cz/admin/users/images/1529658364_KopeckáMartafotonašířku.png','+420 601 103 135','Recruiter',4,'cs','',806),
	(849,'2018-04-20 15:51:20','Praha','Dle domluvy','','','','','','','','','','','','','','','Marta.maresova@adastragrp.com','Marta','Marešová','1529658364_KopeckáMartafotonašířku.png','https://old2018.acamar.cz/admin/users/images/1529658364_KopeckáMartafotonašířku.png','+420 601 103 135','Recruiter',4,'cs','',744),
	(921,'2019-07-16 12:45:57','Praha','Dle dohody','','','','','','','','','','','','','','','nicole.wiedermannova@adastragrp.com','Nicole','Wiedermannová','1579078266_NW_upravena.png','https://old2018.acamar.cz/admin/users/images/1579078266_NW_upravena.png','+420 702 248 987 ','Recruiter',2,'cs','',875),
