	(938,'2019-09-26 15:23:07','Praha','Dle dohody','ETL Developer','<p>Na&scaron;e mateřsk&aacute; společnost Adastra hled&aacute; do sv&eacute;ho t&yacute;mu, kter&yacute; m&aacute; na starosti spr&aacute;vu a rozvoj DWH spolu s komplexn&iacute;m reportingem pro v&yacute;znamn&eacute;ho klienta v&nbsp;oblasti automotive, novou posilu, kter&aacute; si vezme na starosti v&yacute;voj ETL a pr&aacute;ci s&nbsp;revolučn&iacute; in-memory platformou SAP HANA.</p>','Co budeš mít na starosti: ','<ul>\r\n<li>ETL design, v&yacute;voj a testov&aacute;n&iacute; (SAP Data Services).</li>\r\n<li>Datov&eacute; anal&yacute;zy v oblasti Informačn&iacute;ho Managementu a modelov&aacute;n&iacute;.</li>\r\n<li>Aplikace pokročil&yacute;ch technologi&iacute; a metodik.</li>\r\n<li>Př&iacute;pravu projektov&yacute;ch, odborn&yacute;ch dokumentů a dal&scaron;&iacute;ch v&yacute;stupů.</li>\r\n</ul>','Budeme si rozumět, pokud máš:','<ul>\r\n<li>Alespoň 2 roky zku&scaron;enost&iacute; s&nbsp;n&aacute;vrhem a v&yacute;vojem ETL.</li>\r\n<li>Pokročilou znalost pr&aacute;ce s&nbsp;SQL.</li>\r\n<li>Dobrou znalost relačn&iacute;ch datab&aacute;z&iacute; a DWH (zku&scaron;enost se SAP HANA v&yacute;hodou).</li>\r\n<li>Zku&scaron;enost s&nbsp;datov&yacute;m modelov&aacute;n&iacute;m (znalost PowerDesigner v&yacute;hodou).</li>\r\n<li>Chuť učit se nov&eacute; technologie.</li>\r\n<li>R&aacute;d pr&aacute;ci v&nbsp;mezin&aacute;rodn&iacute;m t&yacute;mu a um&iacute;te anglicky na pokročil&eacute; &uacute;rovni.</li>\r\n</ul>','Proč věříme, že ti v Adastře bude dobře?','<ul>\r\n<li>Osah&aacute;&scaron; si &scaron;pičkov&eacute; technologie pod veden&iacute;m expertů. Během p&aacute;r měs&iacute;ců extr&eacute;mně vyroste&scaron; v kompetenc&iacute;ch.</li>\r\n<li>Rychl&yacute; růst se uk&aacute;že i na mzdě.</li>\r\n<li>Pr&aacute;ci si zorganizuje&scaron; podle sebe. Pracovn&iacute; dobu m&aacute;me flexibiln&iacute; a um&iacute;me se na lecčem domluvit.</li>\r\n<li>Mobil, notebook, stravenky &ndash; to je samozřejmost. Stejně jako odborn&aacute;, jazykov&aacute; a soft skills &scaron;kolen&iacute;.</li>\r\n<li>M&aacute;me plochou strukturu a skvěl&eacute; vztahy v t&yacute;mu. Ž&aacute;dn&eacute; z&aacute;kulisn&iacute; boje, jsme zvykl&iacute; se prostě domluvit.</li>\r\n</ul>','Zaujali jsme tě? Udělej první krok!','<p>Po&scaron;li n&aacute;m tv&eacute; CV nebo odkaz na Linkedin. N&aacute;sledně se spolu spoj&iacute;me a domluv&iacute;me se na dal&scaron;&iacute;m postupu.&nbsp;</p>','','','','','Marta.maresova@adastragrp.com','Marta','Marešová','1529658364_KopeckáMartafotonašířku.png','https://old2018.acamar.cz/admin/users/images/1529658364_KopeckáMartafotonašířku.png','+420 601 103 135','Recruiter',1,'cs','etl-developer',890),
	(939,'2019-09-26 15:44:38','Praha','Dle dohody','BI Konzultant - Reporting a Vizualizace','<p>Do na&scaron;&iacute; mateřsk&eacute; společnosti Adastry hled&aacute;me posilu do t&yacute;mu, kter&yacute; m&aacute; na starosti spr&aacute;vu a rozvoj DWH spolu s komplexn&iacute;m reportingem pro v&yacute;znamn&eacute;ho klienta v&nbsp;oblasti automotive. Hled&aacute;me někoho, kdo si vezme na starosti n&aacute;vrh a v&yacute;voj reportů a n&aacute;slednou vizualizaci.</p>','Co budeš mít na starosti: ','<ul>\r\n<li>Komunikaci se z&aacute;kazn&iacute;kem, sběr požadavků.</li>\r\n<li>V&yacute;voj a př&iacute;pravu reportů v SAP BO (Lumira, WebIntelligence) a MS Power BI.</li>\r\n<li>Tvorbu efektn&iacute;ch dashboardů.</li>\r\n<li>Př&iacute;pravu projektov&yacute;ch, odborn&yacute;ch dokumentů a dal&scaron;&iacute;ch v&yacute;stupů.</li>\r\n</ul>','Budeme si rozumět, pokud máš:','<ul>\r\n<li>Alespoň ročn&iacute; zku&scaron;enost v oblasti reportingu (znalost SAP BO v&yacute;hodou).</li>\r\n<li>Zku&scaron;enost s prac&iacute; v SQL.</li>\r\n<li>Znalost vizualizačn&iacute;ch n&aacute;strojů &ndash; např. Power BI, Tableau&hellip;</li>\r\n<li>Chuť učit se nov&eacute; technologie (SAP Analytics).</li>\r\n<li>R&aacute;d pr&aacute;ci v mezin&aacute;rodn&iacute;m t&yacute;mu a um&iacute;te anglicky na pokročil&eacute; &uacute;rovni.</li>\r\n<li>V sobě trochu kreativity a dobr&eacute; komunikativn&iacute; schopnosti.</li>\r\n</ul>','Proč věříme, že ti v Adastře bude dobře?','<ul>\r\n<li>Osah&aacute;&scaron; si &scaron;pičkov&eacute; technologie pod veden&iacute;m expertů. Během p&aacute;r měs&iacute;ců extr&eacute;mně vyroste&scaron; v kompetenc&iacute;ch.</li>\r\n<li>Rychl&yacute; růst se uk&aacute;že i na mzdě.</li>\r\n<li>Pr&aacute;ci si zorganizuje&scaron; podle sebe. Pracovn&iacute; dobu m&aacute;me flexibiln&iacute; a lze se na lecčem domluvit.</li>\r\n<li>Mobil, notebook, stravenky &ndash; to je samozřejmost. Stejně jako odborn&aacute;, jazykov&aacute; a soft skills &scaron;kolen&iacute;.</li>\r\n<li>M&aacute;me plochou strukturu a skvěl&eacute; vztahy v t&yacute;mu. Ž&aacute;dn&eacute; z&aacute;kulisn&iacute; boje, jsme zvykl&iacute; se prostě domluvit.</li>\r\n</ul>','Zaujali jsme tě? Udělej první krok!','<p>Po&scaron;li n&aacute;m tv&eacute; CV nebo odlaz na Linkedin. N&aacute;sledně se spolu spoj&iacute;me a domluv&iacute;me se na dal&scaron;&iacute;m postupu.</p>','','','','','Marta.maresova@adastragrp.com','Marta','Marešová','1529658364_KopeckáMartafotonašířku.png','https://old2018.acamar.cz/admin/users/images/1529658364_KopeckáMartafotonašířku.png','+420 601 103 135','Recruiter',4,'cs','bi-konzultant-reporting-a-vizualizace',891),
