	(944,'2019-10-08 16:18:31','Prague','Agreement','Database Marketing Specialist','<p><strong>We are looking for a motivated and knowledgeable database specialist to join Marketing Operations Team of our client. The database marketing specialist is responsible for creating customer segments for International Direct Marketing campaigns using the campaign management tool Unica. Candidates should be proficient with the use of databases and SQL coding, segmentation logics, and campaign/data management in general.</strong></p>','Responsibilities:','<p>Create user segments for International Direct Marketing campaigns in the campaign management tool IBM Unica:&nbsp;</p>\r\n<ul>\r\n<li>program SQL queries (using Teradata or Unica)&nbsp;</li>\r\n<li>provide Marketing campaign analysis</li>\r\n<li>make recommendations and give advice for further targeting possibilities</li>\r\n<li>escalate and manage potential technical problems</li>\r\n<li>correspond with international stakeholders (Asia, Europe, US, Australia)</li>\r\n<li>writing data selection scripts using Unica and Teradata SQL.</li>\r\n<li>independently execute medium complexity DBM campaigns, higher complexity under supervision</li>\r\n<li>setting up sensitive incentive offers</li>\r\n<li>optimize data selection processes</li>\r\n<li>query optimization</li>\r\n<li>responsible for unit testing and general high quality of output&nbsp;</li>\r\n<li>provide support to both clients and internal teams.</li>\r\n</ul>\r\n<p><strong>Essential Competencies:</strong></p>\r\n<ul>\r\n<li>database Programming</li>\r\n<li>teamwork</li>\r\n<li>accountability</li>\r\n<li>analytical Ability</li>\r\n<li>testing and Quality Assurance.</li>\r\n</ul>','Requirements:','<p><strong>Education / Experience: </strong></p>\r\n<ul>\r\n<li>Undergraduate degree with minimum 2 years work experience in Database Marketing, data analysis or &nbsp; &nbsp; Direct Marketing) or a customer analytics environment.</li>\r\n<li>Excellent English language skills are a must &ndash; both written and oral</li>\r\n</ul>\r\n<p><strong>Technical Skills / Competencies:&nbsp;</strong></p>\r\n<ul>\r\n<li>Excellent SQL knowledge and hands-on experience is required.</li>\r\n<li>Strong communication skills.</li>\r\n<li>Highly organized and detail-oriented.</li>\r\n<li>Ability to effectively manage multiple projects with a commitment to meeting project deadlines.</li>\r\n<li>Well organized and able to manage multiple projects in a fast paced and demanding environment.</li>\r\n<li>Work hard, manage work under pressure, measure progress in terms of results, and do not desire or require close supervision.&nbsp;</li>\r\n<li>Teamwork - it is essential for the team to have a close bond working together as one.&nbsp;</li>\r\n<li>Ability to learn and adapt quickly in continuously changing environment.&nbsp;</li>\r\n<li>Accountability - own your work.&nbsp;</li>\r\n<li>Well organized and able to manage multiple projects in a fast paced and demanding environment.</li>\r\n</ul>','Desired: ','<ul>\r\n<li>Experience with any of the software Unica &lsquo;Affinium Campaign&rsquo;, SPSS, SAS or Business Objects is a big plus.&nbsp;</li>\r\n<li>Experience using Adobe Campaign.</li>\r\n<li>Experience using HTML5, XHTML, CSS3 programming skills.</li>\r\n</ul>','Are you interested? Let us know! ','<p>Send us your CV or Linkedin profile and we will contact you back.</p>','','','','','Marta.maresova@adastragrp.com','Marta','Marešová','1529658364_KopeckáMartafotonašířku.png','https://old2018.acamar.cz/admin/users/images/1529658364_KopeckáMartafotonašířku.png','+420 601 103 135','Recruiter',1,'cs','database-marketing-specialist',896),
	(945,'2019-10-08 16:34:04','Prague','Agreement','Marketing Operations Specialist','<p><strong>This person will support company&rsquo;s Onsite Marketing Operations, including the day to day content trafficking and targeting activities, in close collaboration with the relationship marketing team, as well as the continuous process and tool optimization that is necessary to run online operations successfully, with increased efficiency over time.</strong></p>\r\n<p><strong>This position will be based in Prague, Czech Republic, with occasional need for international travel.</strong></p>','Responsibilities:','<ul>\r\n<li>Ensure timely live to site dates of planned campaigns and manage the trafficking and targeting of graphical messages, in close collaboration with the campaign managers, as well as in-line with the overall agreed marketing calendar in these respective countries.</li>\r\n<li>Work with external agencies and internal teams developing tools necessary to maintain consistently working online operations, while helping to drive the tools toward being &ldquo;state of the art&rdquo; content management systems, that are global scalability.</li>\r\n<li>Manage external agency relationships, to ensure continuous improvements of established processes, review finished projects and develop lists of necessary future enhancements to processes / ways of working.</li>\r\n<li>Work closely with the central Planning function to update on own resource levels, in line with the agreed support level needed to deliver the campaigns reflected in the marketing calendar.</li>\r\n<li>Share progress on projects and/or innovations and manage stakeholder expectations in detail</li>\r\n<li>Manage critical issues through to resolution.</li>\r\n</ul>\r\n<p>&nbsp;</p>','Experience:','<ul>\r\n<li>2+ years of online operations in an international online or ecommerce company, managing the operations for various channels, with increasing levels of responsibility.</li>\r\n<li>Experience executing online operations and executing relationship marketing campaigns through online channels, driving proven business results and efficiency gains.</li>\r\n<li>Proven track record of process improvement.</li>\r\n<li>Seasoned at working with agencies, intimately familiar with their processes and expert at getting agencies to deliver the best work on time.</li>\r\n<li>Proven experience of managing and delivering highly complex projects, working across multiple cross-functional teams, geographies and management levels.</li>\r\n<li>Basic Web-related technical skills (HTML, CSS, XML, JavaScript) will be an advantage.</li>\r\n<li>Technical understanding of how online operations work (content management systems, email delivery platforms, segmentation, targeting, tracking, ad serving platforms (e.g. MediaPlex, DoubleClick&hellip;), etc.).</li>\r\n<li>Detail-oriented, highly organized and able to manage multiple tasks and projects simultaneously.</li>\r\n<li>Highly numerate, possessing superior analytical skills.</li>\r\n<li>Ability to succeed in a fast-paced environment with multiple competing priorities.</li>\r\n<li>Ability to identify and understand peer and customer needs, build and maintain strong working relationships.</li>\r\n<li>As all work-related communication is in English, the candidate absolutely must have full working proficiency in English.</li>\r\n<li>Highly developed verbal, written and presentation skills with a keen eye for detail.</li>\r\n</ul>','Are you interested? Let us know!','<p>Send us your CV or Linkedin profile and we will contact you back.&nbsp;</p>','','','','','','','Marta.maresova@adastragrp.com','Marta','Marešová','1529658364_KopeckáMartafotonašířku.png','https://old2018.acamar.cz/admin/users/images/1529658364_KopeckáMartafotonašířku.png','+420 601 103 135','Recruiter',8,'cs','marketing-operations-specialist',897),
