	(952,'2019-11-12 16:56:25','Praha','dle domluvy','IT Analytik/Solution Architect','<p>Pro na&scaron;eho klienta v oblasti bankovnictv&iacute; hled&aacute;me zku&scaron;en&eacute;ho analytika se znalost&iacute; problematiky platebn&iacute;ch karet.&nbsp;</p>','Co od Vás očekáváme:','<ul>\r\n<li>Prokazateln&eacute; seniorn&iacute; zku&scaron;enosti na pozici IT Business Analytika&nbsp;</li>\r\n<li>Veden&iacute; pr&aacute;ce dal&scaron;&iacute;ch analytiků</li>\r\n<li>Znalost nebo zku&scaron;enost s n&aacute;vrhem business procesů (BPMN atp.)</li>\r\n<li>UML, objektov&aacute; anal&yacute;za na pokročil&eacute; &uacute;rovni, RUP&nbsp;</li>\r\n<li>znalost datov&eacute; anal&yacute;zy&nbsp;</li>\r\n<li>znalost a aktivn&iacute; pr&aacute;ce v Enterprise Architect&nbsp;</li>\r\n<li>aktivn&iacute; znalost anglick&eacute;ho jazyka slovem i p&iacute;smem (alespoň C1)</li>\r\n<li>nutn&aacute; znalost oblasti platebn&iacute;ch karet, karetn&iacute;ch sch&eacute;mat MasterCard a VISA</li>\r\n<li>schopnost rychl&eacute; orientace v nezn&aacute;m&eacute;m prostřed&iacute;, flexibilita</li>\r\n<li>komunikačn&iacute; dovednosti - schopnost komunikoat s v&yacute;voj&aacute;ři i obchodn&iacute;mi jednotkami banky&nbsp;</li>\r\n</ul>','Pracovní náplň:','<ul>\r\n<li>Zapojen&iacute; do v&scaron;ech f&aacute;z&iacute; anal&yacute;zy a n&aacute;vrhu ře&scaron;en&iacute; v oblasti platebn&iacute;ch karet</li>\r\n<li>Zpracov&aacute;n&iacute; analytick&yacute;ch podkladů pro v&yacute;voj</li>\r\n<li>Konzultace v průběhu v&yacute;voje a podpora během testov&aacute;n&iacute;&nbsp;</li>\r\n<li>Anal&yacute;za současn&eacute;ho stavu a n&aacute;vrh optim&aacute;ln&iacute;ho ře&scaron;en&iacute;&nbsp;</li>\r\n</ul>','Zaujali jsme Vás? ','<p>Po&scaron;lete n&aacute;m va&scaron;e CV nebo odkaz na LinkedIn. Spoj&iacute;me se s v&aacute;mi a domluv&iacute;me se na dal&scaron;&iacute;m postupu.&nbsp;</p>','','','','','','','Nicole.Cicvarkova@adastragrp.com','Nicole','Cicvárková','1579078233_Upravena_Ni