	(954,'2019-11-12 17:16:30','Pardubice ','dle domluvy','Senior Analytik','<p>Pro na&scaron;eho klienta v oblasti poji&scaron;ťovnictv&iacute; hled&aacute;me zku&scaron;en&eacute;ho analytika.</p>','Co od Vás očekáváme:','<ul>\r\n<li>Alespoň 4 roky zku&scaron;enostn&iacute; v oblasti anal&yacute;zy IT projektů&nbsp;</li>\r\n<li>Znalosti metodik v&yacute;voje IS, UML a datov&eacute;ho modelov&aacute;n&iacute;</li>\r\n<li>Samostatnost, pečlivost, dobr&aacute; komunikace&nbsp;</li>\r\n<li>Zku&scaron;enosti a velmi dobr&eacute; znalosti z oblast&iacute; SOA, messagingu nebo EAI</li>\r\n<li>V&yacute;hodou zku&scaron;enosti s integračn&iacute;mi platformami</li>\r\n<li>V&yacute;hodou znalost poji&scaron;ťovac&iacute;ho prostřed&iacute;</li>\r\n</ul>','Pracovní náplň:','<ul>\r\n<li>Zapojen&iacute; do v&scaron;ech f&aacute;z&iacute; anal&yacute;zy a n&aacute;vrhu ře&scaron;en&iacute; od př&iacute;pravn&yacute;ch studi&iacute; po n&aacute;vrh konkr&eacute;tn&iacute;ch datov&yacute;ch toků</li>\r\n<li>Zpracov&aacute;n&iacute; analytick&yacute;ch podkladů pro v&yacute;voj ve formě sekvenčn&iacute;ch diagramů, n&aacute;vrhu datov&eacute;ho toku, n&aacute;vrhu form&aacute;tů dat a jejich mapov&aacute;n&iacute; na zdrojov&yacute;/c&iacute;lov&yacute; syst&eacute;m</li>\r\n<li>Konzultace v průběhu v&yacute;voje a podpora během testov&aacute;n&iacute;&nbsp;</li>\r\n<li>Možnost zapojit se do rozvoje architektruy integračn&iacute; vrstvy</li>\r\n<li>Dohled nad integrac&iacute; mezi dotčen&yacute;mi syst&eacute;my</li>\r\n<li>Ře&scaron;en&iacute; konfliktů a požadavků na business transformace na jednotliv&yacute;ch rozhran&iacute;ch integrovan&yacute;ch syst&eacute;mů</li>\r\n<li>Validace detailn&iacute; specifikace na tvorbu rozhran&iacute;</li>\r\n<li>Validace testovac&iacute;ch sc&eacute;n&aacute;řů na integrovan&eacute; syst&eacute;my&nbsp;</li>\r\n<li>Připom&iacute;nkov&aacute;n&iacute; pl&aacute;nu integračn&iacute;ch testů&nbsp;</li>\r\n<li>Konzultace chyb z integračn&iacute;ch testů&nbsp;</li>\r\n<li>Konzultace př&iacute;pravy integračn&iacute;ch testovac&iacute;ch prostřed&iacute;&nbsp;</li>\r\n</ul>','Zaujali jsme Vás? ','<p>Po&scaron;lete n&aacute;m va&scaron;e CV nebo odkaz na LinkedIn. Spoj&iacute;me se s v&aacute;mi a domluv&iacute;me se na dal&scaron;&iacute;m postupu.&nbsp;</p>','','','','','','','Nicole.Cicvarkova@adastragrp.com','Nicole','Cicvárková','1579078233_Upravena_Nicole.png','https://old2018.acamar.cz/admin/users/images/1579078233_Upravena_Nicole.png','+420 702 260 811','Recruiter',2,'cs','senior-analytik',906),
