	(964,'2019-11-21 14:34:09','Praha','leden 2020','NRT Analyst','<p>The position of Consultant provides structured analysis of customer requirements and uses this knowledge to provide a well founded perspective within a project/works package (new services, deployments, service take-on) which meet the needs of the customer (regional or global) . This includes the analysis of functional, technical and business requirements which may contribute to the successful design and build and implementation of solutions, supporting business cases and other related documentation such as business or system requirements documents. The role assumes some technical and/or business process expertise, and a responsibility in ensuring that solutions are delivered in line with business requirements of external/internal customers and aligned with architecture recommendations (as well as budgets, timescale and quality). Very important is ability to deal with stakeholders.</p>','Responsibilities: ','<ul>\r\n<li>Working with other areas of IT Services, business project management functions and external customers to ensure tasks are delivered in line with customer expectations.</li>\r\n<li>Interacts with project teams, product managers and technical and customer groups as necessary to resolve process related problems and facilitate a way forward; will typically have broader&nbsp; interaction with the customer in workshops and presentations as well as with Business IT staff in business related questions.</li>\r\n<li>Gathers and manages business requirements, as well as user, functional, technical and process requirements for products, services and/or software applications.</li>\r\n<li>Justifies their project/assignment in terms of context, benefits, options, costs, ROI, risks, dependencies &amp; commitments, before any project is initiated.</li>\r\n<li>Ensures project/assignment completion in accordance with the pre-determined scope, time, budget and quality; plan, prioritizes and communicates status of related tasks.</li>\r\n<li>Generating presentations and documents/story lining.</li>\r\n</ul>','Requirements:','<ul>\r\n<li>Strong technical background preferably with IT degree or equivalent work experienceVery good level of English (spoken and written).</li>\r\n<li>Very strong in business process modeling, business and data analysis.</li>\r\n<li>Experience with formalized business requirements analysis, incl. tools for requirement management.</li>\r\n<li>Ability to analyze and decompose business needs into sets of IT requirements.</li>\r\n<li>Demonstrable customer orientation - builds relationship and is trusted/sought for advice beyond own topic.</li>\r\n<li>Excellent written and verbal communication skills - facilitates open dialogue and communication between stakeholders.</li>\r\n<li>Strong ability to solve problems and propose suitable, alternative solutions.</li>\r\n<li>Proactive; able to work independently on small projects, planning own time and resolving conflicts to achieve time, quality and budget.</li>\r\n<li>Ability to present ideas in business-friendly and user-friendly language.</li>\r\n<li>Flexible and capable of handling multiple tasks at once.</li>\r\n</ul>','Nice to have:','<ul>\r\n<li>&nbsp;Awareness of Forwarding and/or Freight business standards and processes.</li>\r\n</ul>','','','','','','','Nicole.Cicvarkova@adastragrp.com','Nicole','Cicvárková','1579078233_Upravena_Nicole.png','https://old2018.acamar.cz/admin/users/images/1579078233_Upravena_Nicole.png','+420 702 260 811','Recruiter',2,'cs','nrt-analyst',916),
	(967,'2019-12-06 13:46:09','Prague/ HO','by agreement ','Web Developer','<p>For our client&nbsp;based near&nbsp;London we are looking for Web Developer.&nbsp;</p>','Competences:','<ul>\r\n<li>As web developer you will be responsible for the end to end design and delivery of client Websites and/or applications, working closely with clients, project managers and designers.</li>\r\n<li>Using open source technologies such as Opencart or Magento for e-commerce through to Laravel or MVC frameworks to deliver business applications.</li>\r\n</ul>','Required Skills:','<ul>\r\n<li>2 years PHP Development Experience</li>\r\n<li>Ecommerce / Opencart 2 &amp; 3 / Magento 1 &amp; 2</li>\r\n<li>MVC Frameworks / Laravel</li>\r\n<li>MySQL / Database</li>\r\n<li>HTML / CSS / Javascript</li>\r\n</ul>','Core Skills:','<ul>\r\n<li>Client facing experience</li>\r\n<li>Excellent Verbal &amp; Written Communication</li>\r\n<li>Team Player</li>\r\n<li>Attention to detail</li>\r\n<li>Problem Solving</li>\r\n</ul>','Bonus Technical Skills:','<ul>\r\n<li>Linux, Hosting &amp; Plesk</li>\r\n<li>Wordpress</li>\r\n<li>Modern Front End Workflows</li>\r\n<li>Used GIT or equivalent</li>\r\n<li>Application Design</li>\r\n</ul>','Benefits Package:','<ul>\r\n<li>20 days&rsquo; holiday per annum, rising by 1 day per year to a maximum of 24 days.</li>\r\n<li>Workplace Pension Contributions</li>\r\n<li>Profit related bonus scheme (effective after probation period).</li>\r\n</ul>\r\n<p>&nbsp;</p>','Are you interested? Let us know!','<p>Send us your CV or Linkedin profile and we will contact you back.</p>','Nicole.Cicvarkova@adastragrp.com','Nicole','Cicvárková','1579078233_Upravena_Nicole.png','https://old2018.acamar.cz/admin/users/images/1579078233_Upravena_Nicole.png','+420 702 260 811','Recruiter',1,'cs','web-developer',919),
