	(973,'2020-01-08 13:16:09','Praha 9','2/2020','Specialista IT analýzy / Systémový analytik','','Nápň práce:','<ul>\r\n<li>Konzultačn&iacute; a analytick&aacute; pr&aacute;ce na projektech port&aacute;lov&eacute;ho t&yacute;mu</li>\r\n<li>N&aacute;vrhy ře&scaron;en&iacute;, identifikace a podchycen&iacute; rizik</li>\r\n<li>Př&iacute;prava technick&eacute; dokumentace a detailn&iacute; specifikace (HLD, DD &hellip;)</li>\r\n<li>&Uacute;zk&aacute; spolupr&aacute;ce s v&yacute;voj&aacute;ři</li>\r\n<li>Spolupr&aacute;ce s ostatn&iacute;mi dodavateli a zadavateli</li>\r\n<li>Pod&iacute;len&iacute; se na zlep&scaron;en&iacute; st&aacute;vaj&iacute;c&iacute;ch postupů, procesů a syst&eacute;mů s ohledem na potřeby zadavatele</li>\r\n</ul>','Požadavky:','<ul>\r\n<li>Orientace v port&aacute;lov&yacute;ch ře&scaron;en&iacute;ch</li>\r\n<li>Velmi dobr&eacute; analytick&eacute; my&scaron;len&iacute;</li>\r\n<li>Pečlivost, zodpovědnost, komunikativnost a schopnost t&yacute;mov&eacute; pr&aacute;ce</li>\r\n<li>Aktivn&iacute; př&iacute;stup, časov&aacute; flexibilita a odolnost vůči z&aacute;těži</li>\r\n<li>Česk&yacute; jazyk</li>\r\n<li>Anglick&yacute; jazyk (minim&aacute;lně na &uacute;rovni porozuměn&iacute; technick&eacute; dokumentace)</li>\r\n</ul>','Výhodou:','<ul>\r\n<li>Java 8 a vy&scaron;&scaron;&iacute;</li>\r\n<li>Spring MVC, Spring Boot, PHP, Liferay Portal, Vue.js, Vuetify, Webpack</li>\r\n<li>Zku&scaron;enost s komponentami Zuul, Eureka, Swagger, ElasticSearch</li>\r\n<li>Relačn&iacute; datab&aacute;ze (Oracle, PostgreSQL)</li>\r\n<li>UML a Enterprise Architect</li>\r\n<li>Verzovac&iacute; n&aacute;stroje (GIT)</li>\r\n<li>IntelliJ IDEA</li>\r\n</ul>','','','','','','','Nicole.Cicvarkova@adastragrp.com','Nicole','Cicvárková','1579078233_Upravena_Nicole.png','https://old2018.acamar.cz/admin/users/images/1579078233_Upravena_Nicole.png','+420 702 260 811','Recruiter',2,'cs','specialista-it-analyzy-systemovy-analytik',924),
