	(975,'2020-01-13 15:06:53','Praha','Dle dohody','SQL Developer','<p>Aktu&aacute;lně hled&aacute;me novou posilu na pozici SQL Developer na projekt na&scaron;&iacute; mateřsk&eacute; firmy Adastra pro z&aacute;kazn&iacute;ka v oblasti telekomunikac&iacute; v r&aacute;mci Adastř&iacute; divize Telco a Retail.</p>\r\n<p>&nbsp;</p>','Co budete mít na starosti:','<ul>\r\n<li>Integraci nov&yacute;ch datov&yacute;ch extraktů do DWH.</li>\r\n<li>Integraci vyhodnocen&yacute;ch dat do požadovan&yacute;ch reportů.</li>\r\n<li>Automatizaci datov&yacute;ch v&yacute;stupů, resp. reportů.</li>\r\n<li>Před&aacute;vku vytvořen&yacute;ch skriptů a struktur intern&iacute;m zaměstnancům.</li>\r\n</ul>','Budeme si rozumět, pokud: ','<ul>\r\n<li>Pracujete s SQL na pokročil&eacute; &uacute;rovni.</li>\r\n<li>Zn&aacute;te DWH a souvisej&iacute;c&iacute; n&aacute;stroje. (v&yacute;hodou)</li>\r\n<li>Mluv&iacute;te plynně česky nebo slovensky a m&aacute;te angličtinu alespoň na čten&iacute; technick&eacute; dokumentace.</li>\r\n</ul>','Zaujali jsme Vás? Udělejte první krok!','<p>Po&scaron;lete n&aacute;m Va&scaron;e CV nebo odkaz na Linkedin. Budeme se tě&scaron;it!</p>','','','','','','','Nicole.Cicvarkova@adastragrp.com','Nicole','Cicvárková','1579078233_Upravena_Nicole.png','https://old2018.acamar.cz/admin/users/images/1579078233_Upravena_Nicole.png','+420 702 260 811','Recruiter',1,'cs','sql-developer',926),
