	(981,'2020-01-17 16:07:48','Praha','ASAP','Python Developer','<p>Pro projekt v&nbsp;oblasti telekomunikac&iacute; hled&aacute;me 2 zku&scaron;en&eacute; Python developery v&nbsp;ide&aacute;ln&iacute;m př&iacute;padě se zku&scaron;enost&iacute; s&nbsp;geoanal&yacute;zou. Podm&iacute;nkou je pr&aacute;ce on-site v&nbsp;Praze.</p>','Budeme si rozumět, pokud... ','<ul>\r\n<li>Zn&aacute;&scaron; Python 3 a m&aacute;&scaron; zku&scaron;enosti s v&yacute;vojem v OOP modelu &ndash; alespoň 3 realizovan&eacute; projekty.</li>\r\n<li>M&aacute;&scaron; zku&scaron;enosti s n&aacute;sleduj&iacute;c&iacute;mi knihovnami:\r\n<ul>\r\n<li>Reportlab, Cartopy, networkX, shapely, pyproj, matplotlib, fiona,</li>\r\n<li>Numpy, (geo)pandas, sqlAlchemy, scipy, requests</li>\r\n</ul>\r\n</li>\r\n<li>Mluv&iacute;&scaron; plynule česky/slovensky a angličtinu zvl&aacute;d&aacute;&scaron; alespoň na středně pokročil&eacute; &uacute;rovni.</li>\r\n<li>M&aacute;&scaron; r&aacute;d agiln&iacute; v&yacute;voj a vyhovuje ti samostatnost.</li>\r\n</ul>','Výhodu budeš mít, pokud...','<ul>\r\n<li>M&aacute;&scaron; zku&scaron;enost s geoanal&yacute;zou, orientac&iacute; v OpenStreetMap, orientac&iacute; v RUIAN registru&hellip;</li>\r\n</ul>','Zaujalo tě to? Udělej první krok! ','<p>Po&scaron;li n&aacute;m CV nebo odkaz na Linkedin. Spoj&iacute;me se s tebou a domluv&iacute;me se na dal&scaron;&iacute;ch kroc&iacute;ch.&nbsp;</p>','','','','','','','nicole.wiedermannova@adastragrp.com','Nicole','Wiedermannová','1579078266_NW_upravena.png','https://old2018.acamar.cz/admin/users/images/1579078266_NW_upravena.png','+420 702 248 987 ','Recruiter',1,'cs','python-developer',929),
