	(67,'Delivery lead','Nicole Cicvárková','Nicole.Cicvarkova@adastragrp.com','Michal','Jaroš','MICHAL.JAROS@COMPUCON.CZ','602569342','cv/e11b752811a31ed4d9c68e1dad4fd4a6/Zivot_STR_JAMI_20190808_CZENG.docx','https://www.linkedin.com/in/michal-jaro%C5%A1-9996675/','Dobrý den,\r\nzpravidla oslovuji agenturu, nyní oslovila agentura mě. Třeba to bude zahájení úspěšné spolupráce. Tak se Těším.\r\nMichal Jaroš','2019-11-18 17:47:19',NULL),
	(68,'Delivery lead','Nicole Cicvárková','Nicole.Cicvarkova@adastragrp.com','Jiří','Kehar','jkehar@seznam.cz','+420603151926','cv/4218f3caf37f45d8ef599b7991cd3dc8/CV_Jiri_Kehar_Eng_20191010.doc','','Dobrý den,\r\nkontrakt mi zřejmě bude končit 12/2019. Mám proto zájem o následnou nabídku.\r\nS pozdravem,\r\nJiří Kehar','2019-11-18 19:14:08',NULL),
	(69,'Python Developer','Nicole Wiedermannová','nicole.wiedermannova@adastragrp.com','Ján','Ihnát','jnihnat@gmail.com','602637873','cv/0ed596c7fd5ac5e4627ce9e45d312615/CV_-_Ihnat.pdf','https://www.linkedin.com/in/jan-ihnat-05833b71','Dobrý deň,\r\nzaujala ma vaša ponuka na pozíciu python developera, keď už dlhšie rozmýšľam nad zmenou zamerania z testingu na vývoj. Jedinou mojou nevýhodou sú menšie skúsenosti, kde som programoval len na škole a doma na vlastnom menšom projekte. Mám ale veľký záujem sa zdokonaľovať v programovaní a myslím si že snahou by som vedel skúsenosti do istej miery nahradiť. Preto prosím aj v prípade že pre skúsenosti by som vám nevyhovoval o zváženie ďalšej spolupráce.\r\nĎakujem,\r\nJán','2019-11-19 21:56:18',NULL),
	(70,'Project Manager - Vývoj webových aplikací','Nicole Wiedermannová','nicole.wiedermannova@adastragrp.com','Martin','Procházka','mprochazka20@hotmail.com','723351041','cv/ccc5c106e98d3a29a80c7d75a44c9793/CV_mprochazka.pdf','https://www.linkedin.com/in/mprochazka20/','Primárně čerstvé ovoce a sekundárně vše nad ním :) Více rád sdělím osobně.','2019-11-20 09:18:03',NULL),
	(71,'Recruiter for Russian-speaking markets','Tereza Jarolímková','tereza.jarolimkova@acamar.cz','Ramin','Akhundov','ramin.akhundov@gmail.com','+420608305106','cv/b6441ef73c51ac86a279171959decac4/RAMIN_AKHUNDOV_CV__lgIRCov.docx','https://www.linkedin.com/in/raminakhundov/','Dear Ms Jarolimkova,  \r\nI am writing to apply for the position of Recruiter for Russian - speaking market at Acamar. \r\n\r\nThis position really excites me as having read the JD and information about Acamar and its way of working, I saw a perfect fit.  Not only do I possess the needed skills (including native Russian knowledge) but also needed soft skills as communication, hardworking, persuasion, negotiation and maturity. \r\n\r\nI am an EU citizen (UK citizen) and I hold a residence certificate for Czech Republic. I have an established record of accomplishment in marketing, sales, international market entry, customer service and engagement and project management, having worked across Europe and CIS counties. I am fluent in English (native), Russian (native), Azerbaijani (Fluent), Turkish (advance), Czech (beginner) but studying intensely. \r\n\r\nHere is some of my previous experience in the similar position that would be of a great use:  \r\n- I have mapped out and implemented a market entry, sales and product engagement strategy of US furniture brand Herman Miller into CIS market. I was the sole representative of the brand in CIS (Azerbaijan based), where I established dominant presence by opening and operating a showroom, carrying our necessary marketing activities, getting the events and done by participating in appropriate events. As I am a native Russian speaker and have worked in CIS for over 15 years, have good connections and acquaintances in Russia, Kazakhstan, Ukraine, Georgia and Azerbaijan it was not difficult to establish the brand and good sales. \r\n- While at Samsung, I was responsible for Azerbaijani and Georgian markets’ marketing, product rollout and retail operations. My responsibility was to apply global marketing, sales and product rollout strategy to my region CIS Caucasus and keep the marketing and sales stable as top in CIS. \r\n- I hold a great understanding of what customer focus is, having worked a client services director for McCann Erickson - the world leading creative agency for 5 years, where I managed FMCG brand such as Unilever, GSK, Kimberley Clark. \r\n- Gained superb knowledge based on experience of being a marketing and brand champion for such brands as Orange UK, Samsung Caucuses and Nar (telecom) in Azerbaijan. I have managed a marketing communications department with brand, advertising, digital and digital client support units in it. \r\n- Strong dedication and result orientation proven over years of experience.\r\n- Great client target achieving, as I had founded and managed my own agency and have reached results that overcame my expectations. \r\n\r\nI am currently based in Baku Azerbaijan working as a British expat for a local telecom operator as a Head of marketing and product communications department, and am planning to move to Czech Republic with my family; hence, I am available to relocate ASAP. \r\nI look forward to hearing from you soon and available to attend any needed interviews.\r\n\r\nRegards\r\nRamin.','2019-12-16 12:41:16',NULL),
	(72,'QA Agile Tester','Gabriela Skálová','Gabriela.Skalova@acamar.cz','Petr','Matěj','petr.matej@gmail.com','731348984','cv/60f282dbb00e2b70540edd3d2df0c486/Petr_Matěj_CV_20.pdf','','Dobrý den, s testováním softwaru mám zatím pouze okrajové zkušenosti v Seleniu webdriver a InteliJ idea, rad bych se však v tomto oboru radikalneji rozvíjel, umím základy objektoveho programování v jazycích Java, Python, C, JavaScript a příkazy v MySQL, mám též případně zkušenosti s projektovým řízením, agilnim vývojem a vedením malého týmu lidi. Pokud Vás můj životopis zaujme, budu rád za kontaktování. Předem děkuji za příležitost, s pozdravem Petr Matěj.','2020-01-10 12:35:57',NULL),
	(73,'Database Marketing Specialist','Marta Marešová','Marta.maresova@adastragrp.com','Test','Test','test@test.cz','888 999 000','','','','2020-01-24 13:27:24',944),
	(74,' QA Agile Tester – Agile Siebel','Nicole Cicvárková','Nicole.Cicvarkova@adastragrp.com','Jiří','Roun','jiri.roun@swdokumentace.cz','728281616','cv/7b62b0610976b762abe420a51c1cb233/CV_Roun_Jiří.pdf','','Dobrý den.\r\nO danou pozici (případně o jiné pozicie Tester / Test analytik) bych měl zájem.\r\nChtěl bych však nadále zůstat OSVČ.\r\nV Adastře jsem také nějaký čas pracoval a za Adastru byl i na několika projektech.\r\nPoznámka: Nemám dobrou angličtinu (podklady čtu prakticky denně, ale ze mě nic moc kloudného neleze).\r\nDěkuji.\r\nJiří Roun','2020-01-25 09:10:39',NULL),
