INSERT INTO `acamar_web_acardbenefitsitem` (`cmsplugin_ptr_id`, `title`, `subtitle`, `text`, `icon_id`)
VALUES
	(264,' Účetnictví','Petra Řeháčková perfektně rozumí účetnictví a má trpělivost na komunikaci s úřady.','<p><b>Kdo to je:</b></p>\n\n<ul>\n	<li class=\"MsoNoSpacing\" style=\"\"><span style=\"font-size: 11pt;\"><span style=\"font-family: Arial,sans-serif;\">Účetní a účetní poradce, který ví o daních vše a rád se o tebe postará i v zastupování s úřady.</span></span></li>\n</ul>\n\n<p><b>Co nabízí a za kolik:</b></p>\n\n<ul>\n	<li style=\"margin: 0cm;\">Kompletní vedení a správu účetnictví, zastupování před úřady -  jak pro fyzické, tak i pro právnické osoby. To vše s 30% slevou.</li>\n</ul>\n\n<p style=\"\"><span style=\"font-size: 11pt;\"><span style=\"line-height: normal;\"><span style=\"font-family: Calibri, sans-serif;\"><span style=\"\"><span style=\"color: #000000;\"><span style=\"font-style: normal;\"><span style=\"\"><span style=\"font-weight: normal;\"><span style=\"letter-spacing: normal;\"><span style=\"\"><span style=\"\"><span style=\"white-space: normal;\"><span style=\"\"><span style=\"\"><span style=\"\"><span style=\"text-decoration: none;\"><span style=\"background-color: white;\"><span style=\"\"><span style=\"\"><b><span lang=\"EN-US\" style=\"font-size: 10.5pt;\"><span style=\"font-family: Helvetica;\"><span style=\"color: #333333;\">Email:</span></span></span></b><span lang=\"EN-US\" style=\"font-size: 10.5pt;\"><span style=\"font-family: Helvetica;\"><span style=\"color: #333333;\"> rehackova.petra@seznam.cz</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\n\n<p style=\"\"><span style=\"font-size: 11pt;\"><span style=\"line-height: normal;\"><span style=\"font-family: Calibri, sans-serif;\"><span style=\"\"><span style=\"color: #000000;\"><span style=\"font-style: normal;\"><span style=\"\"><span style=\"font-weight: normal;\"><span style=\"letter-spacing: normal;\"><span style=\"\"><span style=\"\"><span style=\"white-space: normal;\"><span style=\"\"><span style=\"\"><span style=\"\"><span style=\"text-decoration: none;\"><span style=\"background-color: white;\"><span style=\"\"><span style=\"\"><b><span lang=\"EN-US\" style=\"font-size: 10.5pt;\"><span style=\"font-family: Helvetica;\"><span style=\"color: #333333;\">Tel:</span></span></span></b><span lang=\"EN-US\" style=\"font-size: 10.5pt;\"><span style=\"font-family: Helvetica;\"><span style=\"color: #333333;\"> +420 602 160 068</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\n\n<p style=\"\"> </p>\n',22),
	(265,'Právní služby','Přemek opravdu ví. Umí vyřešit cokoliv. Osobně jsme to vyzkoušeli.','<p class=\"MsoNoSpacing\" style=\"\"><span style=\"font-size: 11pt;\"><span style=\"font-family: Arial, sans-serif;\"><span style=\"\"><span style=\"color: #000000;\"><span style=\"font-style: normal;\"><span style=\"\"><span style=\"font-weight: normal;\"><span style=\"letter-spacing: normal;\"><span style=\"\"><span style=\"\"><span style=\"white-space: normal;\"><span style=\"\"><span style=\"\"><span style=\"\"><span style=\"text-decoration: none;\"><b>Kdo to je:</b></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\n\n<ul>\n	<li class=\"MsoNoSpacing\" style=\"\"><span style=\"font-size: 11pt;\"><span style=\"font-family: Arial,sans-serif;\">Přemek Líbal pomáhal s uzavíráním smluv s dodavateli a zákazníky na všech kontinentech. S výjimkou Antarktidy. Zatím!</span></span></li>\n</ul>\n\n<p class=\"MsoNoSpacing\" style=\"\"><span style=\"font-size: 11pt;\"><span style=\"font-family: Arial, sans-serif;\"><span style=\"\"><span style=\"color: #000000;\"><span style=\"font-style: normal;\"><span style=\"\"><span style=\"font-weight: normal;\"><span style=\"letter-spacing: normal;\"><span style=\"\"><span style=\"\"><span style=\"white-space: normal;\"><span style=\"\"><span style=\"\"><span style=\"\"><span style=\"text-decoration: none;\"><b>Co nabízí a za kolik: </b></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\n\n<ul>\n	<li class=\"MsoNoSpacing\" style=\"\"><span style=\"font-size: 11pt;\"><span style=\"font-family: Arial,sans-serif;\">Ve spolupráci s partnerskými advokáty a advokátními kancelářemi zajistí komplexní právní podporu ve všech oblastech života.</span></span></li>\n	<li class=\"MsoNoSpacing\" style=\"\"><span style=\"font-size: 11pt;\"><span style=\"font-family: Arial,sans-serif;\">Obchodní, osobní, trestní, nemovitosti, rodina spolupracuje.</span></span></li>\n	<li class=\"MsoNoSpacing\" style=\"\"><span style=\"font-size: 11pt;\"><span style=\"font-family: Arial,sans-serif;\">Ceny dohodou s tím, že držité ACArty budou zvýhodněni proti běžným klientům.</span></span></li>\n</ul>\n\n<p class=\"MsoNoSpacing\" style=\"\"><span style=\"font-size: 11pt;\"><span style=\"font-family: Arial, sans-serif;\"><span style=\"\"><span style=\"color: #000000;\"><span style=\"font-style: normal;\"><span style=\"\"><span style=\"font-weight: normal;\"><span style=\"letter-spacing: normal;\"><span style=\"\"><span style=\"\"><span style=\"white-space: normal;\"><span style=\"\"><span style=\"\"><span style=\"\"><span style=\"text-decoration: none;\"><b>Odkaz:</b> http://www.proboston.com</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\n\n<p class=\"MsoNoSpacing\" style=\"\"><span style=\"font-size: 11pt;\"><span style=\"font-family: Arial, sans-serif;\"><span style=\"\"><span style=\"color: #000000;\"><span style=\"font-style: normal;\"><span style=\"\"><span style=\"font-weight: normal;\"><span style=\"letter-spacing: normal;\"><span style=\"\"><span style=\"\"><span style=\"white-space: normal;\"><span style=\"\"><span style=\"\"><span style=\"\"><span style=\"text-decoration: none;\"><b>Email:</b> premysl.libal@proboston.com</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\n\n<p class=\"MsoNoSpacing\" style=\"\"><span style=\"font-size: 11pt;\"><span style=\"font-family: Arial, sans-serif;\"><span style=\"\"><span style=\"color: #000000;\"><span style=\"font-style: normal;\"><span style=\"\"><span style=\"font-weight: normal;\"><span style=\"letter-spacing: normal;\"><span style=\"\"><span style=\"\"><span style=\"white-space: normal;\"><span style=\"\"><span style=\"\"><span style=\"\"><span style=\"text-decoration: none;\"><b>Tel:</b> +420 739 026 260</span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\n\n<p class=\"MsoNoSpacing\" style=\"\"> </p>\n',85),
	(497,'Letuška.cz','Až budete řešit dovolenou, tady najdete letenky a ubytování za skvělé ceny.','<p class=\"MsoNoSpacing\" style=\"\"><span style=\"font-size: 11pt;\"><span style=\"font-family: Arial, sans-serif;\"><span style=\"\"><span style=\"color: #000000;\"><span style=\"font-style: normal;\"><span style=\"\"><span style=\"font-weight: normal;\"><span style=\"letter-spacing: normal;\"><span style=\"\"><span style=\"\"><span style=\"white-space: normal;\"><span style=\"\"><span style=\"\"><span style=\"\"><span style=\"text-decoration: none;\"><b>Kdo to je:</b></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\n\n<ul>\n	<li class=\"MsoNoSpacing\" style=\"\"><span style=\"font-size: 11pt;\"><span style=\"font-family: Arial,sans-serif;\">Na Letušce si můžete rezervovat letenky a objednávat veškeré možné služby spojené s cestováním po celém světě.</span></span></li>\n</ul>\n\n<p class=\"MsoNoSpacing\" style=\"\"><span style=\"font-size: 11pt;\"><span style=\"font-family: Arial, sans-serif;\"><span style=\"\"><span style=\"color: #000000;\"><span style=\"font-style: normal;\"><span style=\"\"><span style=\"font-weight: normal;\"><span style=\"letter-spacing: normal;\"><span style=\"\"><span style=\"\"><span style=\"white-space: normal;\"><span style=\"\"><span style=\"\"><span style=\"\"><span style=\"text-decoration: none;\"><b>Co nabízí a za kolik:</b></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\n\n<ul>\n	<li class=\"MsoNoSpacing\" style=\"\"><span style=\"font-size: 11pt;\"><span style=\"font-family: Arial,sans-serif;\">Jako benefit jsme pro vás sjednali slevu <b>490,- Kč</b>, kterou získáte formou promo kódu.</span></span></li>\n	<li class=\"MsoNoSpacing\" style=\"\"><span style=\"font-size: 11pt;\"><span style=\"font-family: Arial,sans-serif;\">Promo kód je: <b>ACAMAR_016540</b>, je jednotný pro všechny, platný do 31.12.2018 a počet jeho