	(5334,'Realitní služby','Michal Pospíšil je skutečný profesionál, na kterého se můžete spolehnout. ','<p class=\"MsoNoSpacing\" style=\"\"><span style=\"font-size: 11pt;\"><span style=\"font-family: Arial, sans-serif;\"><span style=\"\"><span style=\"color: #000000;\"><span style=\"font-style: normal;\"><span style=\"\"><span style=\"font-weight: normal;\"><span style=\"letter-spacing: normal;\"><span style=\"\"><span style=\"\"><span style=\"white-space: normal;\"><span style=\"\"><span style=\"\"><span style=\"\"><span style=\"text-decoration: none;\"><b>Kdo to je:</b></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\n\n<ul>\n	<li class=\"MsoNoSpacing\" style=\"\"><span style=\"font-size: 11pt;\"><span style=\"font-family: Arial,sans-serif;\">Komplexní realitní kancelář - zařídí nákup, prodej, pronájem všech typů nemovitostí (byt, dům, iglú, týpí...).</span></span></li>\n</ul>\n\n<p class=\"MsoNoSpacing\" style=\"\"><span style=\"font-size: 11pt;\"><span style=\"font-family: Arial, sans-serif;\"><span style=\"\"><span style=\"color: #000000;\"><span style=\"font-style: normal;\"><span style=\"\"><span style=\"font-weight: normal;\"><span style=\"letter-spacing: normal;\"><span style=\"\"><span style=\"\"><span style=\"white-space: normal;\"><span style=\"\"><span style=\"\"><span style=\"\"><span style=\"text-decoration: none;\"><b>Co nabízí a za kolik:</b></span></span></span></span></span></span></span></span></span></span></span></span></span></span></span></p>\n\n<ul>\n	<li class=\"MsoNoSpacing\" style=\"\"><span style=\"font-size: 11pt;\"><span style=\"font-family: Arial,sans-serif;\">Komplexní poradenství v oblasti prodejů i pronájmů.</span></span></li>\n	<li class=\"MsoNoSpacing\" style=\"\"><span style=\"font-size: 11pt;\"><span style=\"font-family: Arial,sans-serif;\">Zprostředkování pronájmů a prodejů nemovitostí.</span></span></li>\n	<li class=\"MsoNoSpacing\" style=\"\"><span style=\"font-siz