	(107,'Rotace ​​​​​​​na projektech','Končíte na projektu? Systém nám to ohlásí. Sami se ozveme se zajímavými nabídkami. I na kontraktu tak máte stále jistotu práce.\r\n','22','měsíců je průměrná doba projektu'),
	(108,'Žádné složité papírování','Řešíme za vás veškerou administrativu. Proces fakturace urychluje náš vlastní systém.\r\n','0','počet e-mailů nutných k fakturaci'),
	(1173,'Get your money on time as a contractor or an employee','Our payment system runs like clockwork so your invoices always get paid on time.\r\nOn top of that, you’ll be given an A-carta  with lots of benefits and discounts on it.','0 %','overdue invoices'),
	(1174,'Switching among projects','Is your current project coming to an end? Our system will notify us.\r\nWe’ll get in touch and come up with some interesting offers.\r\nEven as a contractor, you won’t be without work.','22','months is the average project duration'),
	(1175,'No difficult paperwork','We’ll take care of all the paperwork.\r\nAnd everything will be 100% legal and in order here.\r\n','0','number of e-mails required for billing'),
	(1268,'Выплата зарплаты в срок с точностью швейцарских часов. Вы можете быть трудоустроены как в качестве частного проедпринимателя, так и сотрудника, работающего по трудовому договору.','Зарплату мы переводим точно в срок.\r\nК тому же Вы получите А-карту с множеством выгодных предложений и скидок.','0 %','просроченные счета'),
	(1269,'Работа над проектами','Вы заканчиваете определённый проект или работу? Наша система сообщает нам об этом.\r\nМы сами свяжемся с Вами и предложим Вам новые интересные проекты и вакансии.\r\nУ Вас всегда будет стабильная работа по контракту.','22','месяца - средняя продолжительность проекта'),
	(1270,'Нет ненужной административки','Мы решим за Вас все административные вопросы. Все юридические вопросы всегда тщательно проверяются и согласуются.','0','электронных писем, необходимых для выставления счетов'),
	(4810,'Finanční pohoda ​​​​​​​na IČO i HPP','Faktury platíme s přesností švýcarských hodinek. Navíc dostanete Acartu se spoustou benefitů a slev.\r\n','0 %','faktur po splatnosti'),
