	(4834,'No difficult paperwork','We’ll take care of all the paperwork.\r\nAnd everything will be 100% legal and in order here.\r\n','0','number of e-mails required for billing'),
	(5015,'Выплата зарплаты в срок с точностью швейцарских часов. Вы можете быть трудоустроены как в качестве частного проедпринимателя, так и сотрудника, работающего по трудовому договору.','Зарплату мы переводим точно в срок.\r\nК тому же Вы получите А-карту с множеством выгодных предложений и скидок.','0 %','просроченные счета'),
