	(1509,'Arthurgeots','123teatr@gmail.com','�����','<img src=\"https://ptzgovorit.ru/sites/default/files/original_nodes/lyubov_v_internete.jpg\"> \r\n<u>je možné najít svou lásku online? Pod ležícím kamenem neteče voda. Bez obtíží a ryby nemohou dostat z rybníka. Všechny tyto přísloví známe již od dětství. Už jste někdy vážně přemýšleli o aplikaci lidových moudrostí k životu? Mně se vždy zdálo, že tyto присказки ano прибаутки přicházejí babičky ve vesnicích kvůli zábavě, ale bylo to přesně do chvíle, kdy jsem si uvědomil, jak moc jsou жизненны. </u> \r\n \r\n \r\nNejprve byly zkoušky ve škole, taneční třídy, pak přijetí na instituce, resp, ochrana diplomu, práce... A všude bylo třeba projevit trpělivost, úsilí, naši spokojenost hodně sil a času. Ale nedokázala jsem si představit, že vztah s muži by měl být také osloven, což se nazývá, vážně. Zdá se, že tolik známých, velká společnost a kavárny / kluby / restaurace nejsou nejhorším místem pro datování. Ale neměl jsem štěstí. To žvejkání, Hum, lhář a tak dále. Byli, samozřejmě, a hodní fanoušci, ale přesto nikdo nedržel. \r\n \r\npak jsem zrovna našla práci. </b>K nalezení práce jsem přišla vážně — вставала každý den ráno a během dne s přestávkou na oběd pracovala u počítače, обзванивала, zpět do reinvestovat životopis, договаривалась o pohovory. Jedním slovem byla moje práce hledání práce. Když jsem přemýšlela o tom vztahu, uvědomila jsem si, proč jsem si jistá, že mi krásný princ spadne z nebe přímo na hlavu? Proč jsem si myslela, že bez námahy budu mít to, co chci - i když i nehmotné? Samozřejmě, že provádím, tak řekněme, minimálně-od rána se uklidňuji, snažím se stylově oblékat, sledovat vlasy a nehty. Ale to zjevně nestačí. Poté, co jsem se rozhodl pro své touhy (a chtěl jsem něco vážnějšího a vědomějšího než jen pobíhat po filmech a procházkách v parcích), začal jsem \"pracovat\". \r\n \r\n \r\n<b>pro začátek \"neúmyslně\" řekl všem známým, že jsem na pozoru — hodili několik kandidátů.</b>pak jsme s Přítelkyněmi začali pravidelně chodit do klubu. Ale! Pro sebe jsem si uvědomil, že klub není nejlepší místo pro datování. Proč? Za prvé, velmi hlučné, za druhé, tmavé, za třetí, všechno \"trochu\" pod shafe. Takže pokud chcete vážnost, pak klub zmizí sám. Možností zbylo trochu — buď Internet, nebo čekat na milost paní hodně Štěstí a pozor na prince na zastávkách, v obchodech, kavárnách a tak dále. Ale já jsem člověk, který není zvyklý sedět, takže jsem se obrátil na internet. \r\n \r\nVe skutečnosti, princip použila stejný jako při hledání zaměstnání, s výjimkou toho, že brzy nebude вставала, a musím se přiznat, prohlédnout profily krásných chlapů je přece jen příjemnější, než práce. Přítelkyně reagovala překvapivě jednomyslně-fuuu! Jak jsi mohla! Seznámení se s internetem je hrozné, na internetu jsou jen maniaci a nadržení. Rozrušení a пристыженная, už jsem se chystala ukončit svou kampaň na hledání partnera, ale nejprve se rozhodla svěřit se se starým kamarádem. \"A co je v tom? - zeptal se ho. - Internet je jen jeden způsob, tak proč se musíš vzdát této příležitosti? Kvůli názorům druhých? Jsou vdaná nebo pár?\"V tom okamžiku byla většina mých přítelkyň osamělá. Tak jsem se rozhodl neodstraňovat svůj dotazník a pokračovat v hledání, ale ne inzerovat to. Ve skutečnosti, maniaci a ne zcela rozumní mladí lidé - alespoň trochu, ale i normální kluci, kteří znají lekce zdvořilosti, také našli hodně! Obecně platí, že již v prvních několika zprávách můžete pochopit-osoba je adekvátní nebo ne. Seznámila jsem se se zajímavými lidmi, s některými jsme se stali přáteli. \r\n \r\n<b>byl jsem překvapen, kolik dobře vzdělaných, vzdělaných, bohatých kluků se seznámí na internetu.</b> ukázalo se, že právě teď je to docela přijatelný způsob datování pro zaneprázdněné lidi. Jak řekl jeden z mých nově objevených fanoušků, je možné najít na nejvíce nečekaných místech dokonale krásné věci. A opravdu, myslím, že každá dívka někdy byla na celkovém prodeji v obchodě s oblečením. To je chaos! V polovině dne se zaměstnanci obchodu již nemohou vyrovnat — a tady a tam jsou obrovské, nebojím se tohoto slova, hromady oblečení. Nějak jsem претило копошиться v těchto сваленных věcech, jako jsou a se suvenýry, a cítí se na trhu, jak říká moje přítelkyně — brouk-навозник. Ale jednoho dne, v takovém skládce, jsem se podařilo vytáhnout naprosto úžasné šaty! Takže, když se vrátíme k lidovým moudrostem, není místo, kde člověk maluje člověka, ale místo člověka. A Internet není výjimkou. Když se přítelkyně dozvěděly o mé operaci s, už se nesměly-vedle mě byl krásný muž. I když možná slovo \"ukázalo se, že\" není vhodné, protože náš pár byl vytvořen v důsledku aktivního hledání navzájem. Zahodili své předsudky, přítelkyně taky přestal брезговать Internetu, což nakonec vyústilo v dvě svatby, kde jsem měl to štěstí, гостить! Samozřejmě, já neříkám, že Internet je ideálním místem pro objevování a hledání jeho polovinu, ne, je to jen jedna z možných variant. \r\n \r\n<img src=\"https://www.stihi.ru/pics/2018/03/31/10837.jpg\"> \r\n \r\nA pokud jste se rozhodli přistupovat k tomuto problému se vší vážností, proč se zbavit dalších možností řešení problému? <b>hlavní věc je pochopit, že za prvé, okamžitě, tuto vteřinu, vztah se neobjeví, hledání není snadná práce.</b> navíc samotný vztah není solidní dovolenou, ale opět výsledkem vynaloženého úsilí a dosažených kompromisů. Přemýšlejte o tom, zda chcete něco obětovat, od svého času a úsilí až po něco velkého, jako je odmítnutí práce nebo milovaného koníčka, ve prospěch rodiny. \r\n \r\nTakže, co definoval s přáním, zůstává pouze jednat, protože my — ženy — můžeme dovolit zapojit více záležitostí najednou, a tak historicky — usilovat, tak nebo jinak, také naše стезя, ať už je to přímo vaše akce nebo координирование a delegování. Jděte do toho! \r\n \r\n<b>a doufejme, že ryby, které se vám podaří vytáhnout, budou zlaté.</b> \r\n \r\nOsobně jsem zde vyzkoušela štěstí: \r\n - https://fas.st/-rk7ru Link4you','ru','2019-10-01 15:28:35'),
