ов рынка, многие компании закрывались, не проработав в данной области и одного года, в результате чего на рынке существует большое количество \"мертвых душ\". С учетом показателей экспертов, а также анализа текущей ситуации на рынке, по оценкам специалистов Discovery Research Group в исследовании рынка ломбардов в России, на начало 2013 года в России действовало около 4 тыс. ломбардов, реально занимающихся выдачей кредитов населению. \r\nПри этом практически все специалисты отмечают, что ломбардный бизнес очень привлекательный для инвесторов: для открытия ломбарда не требуется каких-либо разрешений и лицензий со стороны государства, а при грамотном построении бизнеса затраченные инвестиции в средем размере 1-1,5 млн руб будут окуплены в течение 1,5-2 лет. \r\nНа текущий момент по-прежнему наиболее распространенным типом ломбардов являются компании, принимающие под залог ювелирные изделия. \r\n \r\nДА ИХ НА СЕГОДНЯШНИЙ ДЕНЬ ЗНАЧИТЕЛЬНО БОЛЬШЕ!(((( \r\n \r\n<a href=https://ibb.co/ZB47mnd><img src=\"https://i.ibb.co/jy0sRch/UNADJUSTEDNONRAW-thumb-fce.jpg\"></a> \r\n \r\n \r\n \r\n \r\nА вот случай изряда вон выходящий ( \r\n \r\n<a href=https://www.change.org/p/%D0%B2%D1%81%D0%B5-%D0%B3%D1%80%D1%83%D0%BF%D0%BF%D0%B0-%D0%BF%D0%BE%D0%B4%D0%B4%D0%B5%D1%80%D0%B6%D0%BA%D0%B8-%D0%B2%D0%BB%D0%B0%D0%B4%D0%B8%D1%81%D0%BB%D0%B0%D0%B2%D0%B0-%D1%81%D1%82%D0%B5%D0%BD%D0%B8%D0%BD%D0%B0-%D0%BE%D1%88%D0%B8%D0%B1%D0%BE%D1%87%D0%BD%D0%BE-%D0%BE%D0%B1%D0%B2%D0%B8%D0%BD%D0%B5%D0%BD%D0%BD%D0%BE%D0%B3%D0%BE-%D0%BF%D0%BE-%D0%B4%D0%B5%D0%BB%D1%83-%D0%BD%D0%B0%D0%BF%D0%B0%D0%B4%D0%B5%D0%BD%D0%B8%D1%8F-%D0%BD%D0%B0-%D0%BB%D0%BE%D0%BC%D0%B1%D0%B0%D1%80%D0%B4>Владислава Стенина, ошибочно обвили по делу нападения на ломбард.</a> \r\n \r\nПроизошло преступление 1 мая 2018 года.примерно в 16:35 В ломбарде \"Корона\" в городе Димитровград. Как нам стало известно в суде ,через несколько дней после произошедшего приёмщик ломбарда сообщил сотрудникам полиции что Владислав Стенин(мой супруг) похож на пре