	(675,'Ať máte šanci na trhu práce mezi testery, potřebujete základy testování a SQL','','','',NULL),
	(1168,'Drawn towards IT, but still only learning?','Deepen your knowledge in our trainings','Still studying or changing disciplines?\r\nEach of our trainings will broaden your horizons.\r\nAnd if you complete all of them, you can easily apply for a tester position','_alternative',NULL),
	(1229,'Začínáte od nuly?','Absolvujte 3 navazující kurzy.','Už něco umíte? Posuňte se v konkrétním tématu','',NULL),
	(1263,'Вас привлекает IT-сфера, но Вы ещё пока находитесь в процессе обучения?','Предлагаемое нами обучение прекрасно дополнит Ваши знания','Вы учитесь или полностью меняете специальность? \r\nЛюбой из предлагаемых нами курсов расширит Ваш кругозор. \r\nЕсли Вы пройдёте все предлагаемые нами курсы, вы можете смело выдвигать свою кандидатуру на вакансию тестировщика.','_alternative',NULL),
	(1324,'Начинаете с нуля?','Прослушаете 3 последующие курсы.','Уже что-то умеете? Продвинетесь в конкретной теме.','',NULL),
