	(5327,'Drawn towards IT, but still only learning?','Deepen your knowledge in our trainings','Still studying or changing disciplines?\r\nEach of our trainings will broaden your horizons.\r\nAnd if you complete all of them, you can easily apply for a tester position','_alternative',NULL),
