INSERT INTO `acamar_web_htmltext` (`cmsplugin_ptr_id`, `text`)
VALUES
	(5076,'<p align=\"JUSTIFY\">Holding Adastra Group a společnost ADASTRA, s.r.o., kter&aacute; je provozovatelem webu <a href=\"http://www.adastra.cz\">www.adastra.cz</a>, považuje ochranu a důvěrnost va&scaron;ich &uacute;dajů za velmi důležitou. Va&scaron;e osobn&iacute; &uacute;daje zpracov&aacute;v&aacute;me a využ&iacute;v&aacute;me v&nbsp;souladu&nbsp;jak s&nbsp;ustanoven&iacute;mi Česk&yacute;ch pr&aacute;vn&iacute;ch předpisů (z&aacute;kon o ochraně osobn&iacute;ch &uacute;dajů č. 110/2019 Sb.), tak i Evropskou legislativou (Nař&iacute;zen&iacute; Evropsk&eacute;ho parlamentu a Rady (EU) 2016/679).</p>\r\n\r\n<p align=\"JUSTIFY\">\r\n	<br>\r\n</p>\r\n\r\n<p align=\"JUSTIFY\"><strong><span style=\"font-size: 24px;\">Spr&aacute;vce osobn&iacute;ch &uacute;dajů</span></strong></p>\r\n\r\n<p align=\"JUSTIFY\">Spr&aacute;vcem osobn&iacute;ch &uacute;dajů ve smyslu n&aacute;rodn&iacute; a evropsk&eacute; legislativy je:</p>\r\n\r\n<p align=\"JUSTIFY\">ADASTRA, s.r.o.</p>\r\n\r\n<p align=\"JUSTIFY\">Bene&scaron;ovsk&aacute; 1926/8</p>\r\n\r\n<p align=\"JUSTIFY\">Praha 10, 101 00</p>\r\n\r\n<p align=\"JUSTIFY\">IČ: 26202981 DIČ: CZ26202981</p>\r\n\r\n<p align=\"JUSTIFY\">M&aacute;te-li jak&eacute;koli dotazy ohledně zpracov&aacute;n&iacute; a ochrany va&scaron;ich osobn&iacute;ch &uacute;dajů, můžete n&aacute;s kontaktovat e-mailem na adrese: <a href=\"mailto:GDPRCZ@adastragrp.com\">GDPRCZ@adastragrp.com</a>.</p>\r\n\r\n<p align=\"JUSTIFY\">&nbsp;</p>\r\n\r\n<p align=\"JUSTIFY\"><strong><span style=\"font-size: 24px;\">Jak&eacute; osobn&iacute; &uacute;daje zpracov&aacute;v&aacute;me a proč</span></strong></p>\r\n\r\n<p align=\"JUSTIFY\">Největ&scaron;&iacute; č&aacute;st osobn&iacute;ch &uacute;dajů, kter&eacute; zpracov&aacute;v&aacute;me o na&scaron;ich z&aacute;kazn&iacute;c&iacute;ch, dodavatel&iacute;ch a jin&yacute;ch obchodn&iacute;ch stran&aacute;ch, vedeme v souvislosti <strong>s&nbsp;nab&iacute;dkou a poskytov&aacute;n&iacute;m na&scaron;ich služeb</strong> (konzultačn&iacute; činnost v oblasti Information Managementu). V drtiv&eacute; vět&scaron;ině př&iacute;padů se jedn&aacute; o z&aacute;kladn&iacute; kontaktn&iacute; &uacute;daje typu <em>jm&eacute;no, př&iacute;jmen&iacute;, telefon a email</em>. Bez těchto &uacute;dajů s V&aacute;mi logicky nemůžeme komunikovat a tedy zajistit plněn&iacute; na&scaron;ich služeb, kter&eacute; plyne z ř&aacute;dně uzavřen&eacute; <strong>smlouvy</strong>.</p>\r\n\r\n<p align=\"JUSTIFY\"><strong>Pr&aacute;vn&iacute; předpisy a legislativa ČR</strong> n&aacute;m takt&eacute;ž v určit&yacute;ch př&iacute;padech d&aacute;vaj&iacute; povinnost Va&scaron;e osobn&iacute; &uacute;daje zpracov&aacute;vat. Jedn&aacute; se typicky o uchov&aacute;n&iacute; &uacute;dajů dle z&aacute;konn&yacute;ch požadavků z důvodu <strong>veden&iacute;</strong> <strong>&uacute;četnictv&iacute;</strong>.</p>\r\n\r\n<p align=\"JUSTIFY\">Jste-li uchazeč o zaměstn&aacute;n&iacute;, budeme někter&eacute; Va&scaron;e osobn&iacute; &uacute;daje zpracov&aacute;vat pro na&scaron;i potřebu při <strong>n&aacute;boru zaměstnanců</strong> a to proto, abychom s V&aacute;mi popř&iacute;padě mohli podepsat pracovn&iacute; <strong>smlouvu</strong>.</p>\r\n\r\n<p align=\"JUSTIFY\">S Va&scaron;&iacute;m <strong>souhlasem</strong>, jste-li uchazeč o zaměstn&aacute;n&iacute;, archivujeme n&aacute;borovou dokumentaci do odvol&aacute;n&iacute; souhlasu pro potřeby potenci&aacute;ln&iacute; komunikace a <strong>nab&iacute;dky zaměstn&aacute;n&iacute;</strong> u společnosti.</p>\r\n\r\n<p align=\"JUSTIFY\">Na&scaron;im aktivn&iacute;m z&aacute;kazn&iacute;kům si dovolujeme zas&iacute;lat <strong>obchodn&iacute; sdělen&iacute;</strong> s nab&iacute;dkou na&scaron;ich služeb a informacemi o na&scaron;ich produktech na z&aacute;kladě na&scaron;eho <strong>z&aacute;jmu</strong> nab&iacute;zet z&aacute;kazn&iacute;kům vždy aktu&aacute;ln&iacute; a nejlep&scaron;&iacute; technick&eacute; ře&scaron;en&iacute;.</p>\r\n\r\n<p align=\"JUSTIFY\">Mimo v&yacute;&scaron;e zm&iacute;něn&aacute; zpracov&aacute;n&iacute; pořizujeme <strong>videoz&aacute;znam</strong> z na&scaron;eho kamerov&eacute;ho syst&eacute;mu. Čin&iacute;me tak z důvodu <strong>ochrany na&scaron;eho majetku</strong>. Tyto z&aacute;znamy nikdo aktivně nesleduje - mohou b&yacute;t využity až v&nbsp;př&iacute;padě bezpečnostn&iacute;ho incidentu jako důkazn&iacute; materi&aacute;l a jsou archivov&aacute;ny nejd&eacute;le po dobu 14 dnů na na&scaron;em serveru.</p>\r\n\r\n<p align=\"JUSTIFY\">V př&iacute;padě, že jste n&aacute;&scaron; potenci&aacute;ln&iacute; z&aacute;kazn&iacute;k a udělil(a) jste n&aacute;m souhlas, zpracov&aacute;v&aacute;me va&scaron;e osobn&iacute; &uacute;daje k &uacute;čelům zas&iacute;l&aacute;n&iacute; obchodn&iacute;ch sdělen&iacute; - zejm&eacute;na zas&iacute;l&aacute;n&iacute; mailov&eacute;ho osloven&iacute;.</p>\r\n\r\n<p align=\"JUSTIFY\">V&scaron;echny v&yacute;&scaron;e zm&iacute;něn&eacute; osobn&iacute; &uacute;daje, kter&eacute; vznikaj&iacute; z&nbsp;podnětu na&scaron;&iacute; vz&aacute;jemn&eacute; komunikace a interakce, jsou ř&iacute;zeny intern&iacute;m syst&eacute;mem ochrany osobn&iacute;ch &uacute;dajů dle platn&eacute; legislativy. V&nbsp;maxim&aacute;ln&iacute; m&iacute;ře tedy ř&iacute;d&iacute;me př&iacute;stup k&nbsp;osobn&iacute;m &uacute;dajům, technick&aacute; opatřen&iacute; pro jejich zabezpečen&iacute; a dobu jejich existence.</p>\r\n\r\n<p align=\"JUSTIFY\">\r\n	<br>\r\n</p>\r\n\r\n<p align=\"JUSTIFY\"><strong><span style=\"font-size: 24px;\">Doba, po kterou va&scaron;e osobn&iacute; &uacute;daje zpracov&aacute;v&aacute;me</span></strong></p>\r\n\r\n<p align=\"JUSTIFY\">Osobn&iacute; &uacute;daje z&aacute;kazn&iacute;ků a třet&iacute;ch stran zpracov&aacute;v&aacute;me a uchov&aacute;v&aacute;me po dobu nezbytně nutnou k zaji&scaron;těn&iacute; v&scaron;ech pr&aacute;v a povinnost&iacute; plynouc&iacute;ch ze smlouvy, a d&aacute;le po dobu, po kterou jsme povinn&iacute; &uacute;daje uchov&aacute;vat podle obecně z&aacute;vazn&yacute;ch pr&aacute;vn&iacute;ch předpisů.</p>\r\n\r\n<p align=\"JUSTIFY\">Va&scaron;e osobn&iacute; &uacute;daje z&iacute;skan&eacute; na z&aacute;kladě dobrovoln&eacute;ho souhlasu za &uacute;čelem zas&aacute;l&aacute;n&iacute; obchodn&iacute;ch sdělen&iacute; zpracov&aacute;v&aacute;me do odvol&aacute;n&iacute;&nbsp;Va&scaron;eho souhlasu.</p>\r\n\r\n<p align=\"JUSTIFY\">\r\n	<br>\r\n</p>\r\n\r\n<p align=\"JUSTIFY\"><strong><span style=\"font-size: 24px;\">Va&scaron;e pr&aacute;va&nbsp;</span></strong></p>\r\n\r\n<p align=\"JUSTIFY\">Va&scaron;&iacute;m přirozen&yacute;m pr&aacute;vem je obdržet informace o va&scaron;ich datech, kter&eacute; o v&aacute;s zpracov&aacute;v&aacute;me. Stejně tak m&aacute;te pr&aacute;vo na opravu nebo zablokov&aacute;n&iacute; nespr&aacute;vn&yacute;ch či neaktu&aacute;ln&iacute;ch &uacute;dajů, pr&aacute;vo na omezen&iacute; zpracov&aacute;n&iacute; a pr&aacute;vo vzn&eacute;st n&aacute;mitku proti zpracov&aacute;n&iacute;. V&nbsp;určit&yacute;ch př&iacute;padech v&aacute;m n&aacute;lež&iacute; pr&aacute;vo na v&yacute;maz. D&aacute;le jsme povinni va&scaron;e osobn&iacute; &uacute;daje na va&scaron;e pož&aacute;d&aacute;n&iacute; přen&eacute;st na v&aacute;mi zvolen&eacute;ho spr&aacute;vce/zpracovatele osobn&iacute;ch &uacute;dajů.</p>\r\n\r\n<p align=\"JUSTIFY\">Pokud jste n&aacute;m dali souhlas se zpracov&aacute;n&iacute;m va&scaron;ich osobn&iacute;ch &uacute;dajů za &uacute;čelem zas&iacute;l&aacute;n&iacute; obchodn&iacute;ch sdělen&iacute; či osloven&iacute; s potenci&aacute;ln&iacute; pracovn&iacute; nab&iacute;dkou, pak m&aacute;te možnost tento souhlas kdykoliv odvolat. Stač&iacute; n&aacute;s kontaktovat na <a href=\"mailto:GDPRCZ@adastragrp.com\">GDPRCZ@adastragrp.com</a>.</p>\r\n\r\n<p align=\"JUSTIFY\">Tento kontakt využijte i v&nbsp;př&iacute;padech pokud se budete cht&iacute;t zeptat na cokoliv, co se t&yacute;če na&scaron;eho zpracov&aacute;n&iacute; osobn&iacute;ch &uacute;dajů.</p>\r\n\r\n<p align=\"JUSTIFY\">Jste-li přesvědčen&iacute;, že s&nbsp;va&scaron;imi daty nezach&aacute;z&iacute;me adekv&aacute;tně a podle z&aacute;konn&yacute;ch norem, m&aacute;te možnost podat st&iacute;žnost u dozorov&eacute;ho &uacute;řadu, kter&yacute;m je &Uacute;řad pro ochranu osobn&iacute;ch &uacute;dajů.</p>\r\n\r\n<p align=\"JUSTIFY\">\r\n	<br>\r\n</p>\r\n\r\n<p align=\"JUSTIFY\"><strong><span style=\"font-size: 24px;\">Dobrovolnost udělen&iacute; souhlasu</span></strong></p>\r\n\r\n<p align=\"JUSTIFY\">Udělen&iacute; souhlasu se zpracov&aacute;n&iacute;m osobn&iacute;ch &uacute;dajů je zcela dobrovoln&eacute; a nepodmiňuje ž&aacute;dn&eacute; jin&eacute; plněn&iacute; ze strany společnosti ADASTRA, s r.o.</p>\r\n\r\n<p align=\"JUSTIFY\">\r\n	<br>\r\n</p>\r\n\r\n<p align=\"JUSTIFY\"><strong><span style=\"font-size: 24px;\">Přenos osobn&iacute;ch &uacute;dajů</span></strong></p>\r\n\r\n<p align=\"JUSTIFY\"><strong>Ve&scaron;ker&eacute; osobn&iacute; &uacute;daje</strong> z&iacute;skan&eacute; od z&aacute;kazn&iacute;ků a třet&iacute;ch stran <strong>využ&iacute;v&aacute;me v&yacute;hradně pro vnitřn&iacute; potřebu</strong> společnosti, chr&aacute;n&iacute;me před zneužit&iacute;m <strong>a neposkytujeme třet&iacute;m stran&aacute;m&nbsp;</strong>bez předchoz&iacute;ho upozorněn&iacute; nebo souhlasu.</p>\r\n\r\n<p align=\"JUSTIFY\">V&yacute;jimku představuj&iacute; entity holdingu Adastra Group, extern&iacute; společnosti, kter&eacute; pro n&aacute;s zaji&scaron;ťuj&iacute; podpůrn&eacute; služby a org&aacute;ny st&aacute;tn&iacute; moci. Těmto entit&aacute;m va&scaron;e osobn&iacute; &uacute;daje poskytnout můžeme či mus&iacute;me v minim&aacute;ln&iacute;m rozsahu př&iacute;kladově při:</p>\r\n\r\n<ul>\r\n	<li>vy&scaron;etřov&aacute;n&iacute; nez&aacute;konn&eacute;ho využ&iacute;v&aacute;n&iacute; na&scaron;ich služeb nebo pro potřeby soudn&iacute;ho ř&iacute;zen&iacute;, mohou b&yacute;t &uacute;daje před&aacute;ny org&aacute;nům pro vy&scaron;etřov&aacute;n&iacute; trestn&eacute; činnosti.</li>\r\n	<li>spr&aacute;vě na&scaron;ich informačn&iacute;ch syst&eacute;mů a aplikac&iacute;.</li>\r\n</ul>\r\n\r\n<p align=\"JUSTIFY\">U v&scaron;ech těchto poskytovatelů služeb smluvně požadujeme (mimo org&aacute;ny veřejn&eacute; spr&aacute;vy), aby zpracov&aacute;vali va&scaron;e osobn&iacute; &uacute;daje v&nbsp;souladu s&nbsp;podm&iacute;nkami ochrany osobn&iacute;ch &uacute;dajů a platnou legislativou.</p>\r\n\r\n<p align=\"JUSTIFY\">\r\n	<br>\r\n</p>\r\n\r\n<p align=\"JUSTIFY\"><strong><span style=\"font-size: 24px;\">Cookies</span></strong></p>\r\n\r\n<p align=\"JUSTIFY\">Cookies jsou mal&eacute; textov&eacute; soubory, kter&eacute; se ukl&aacute;daj&iacute; ve va&scaron;em zař&iacute;zen&iacute; (poč&iacute;tač, mobiln&iacute; zař&iacute;zen&iacute; nebo jin&eacute;m př&iacute;stroji umožňuj&iacute;c&iacute; př&iacute;stup k internetu) pomoc&iacute; něhož použ&iacute;v&aacute;te e-shop Activacek.cz a pokud je po opu&scaron;těn&iacute; na&scaron;ich str&aacute;nek nesmažete, jsou opět využ&iacute;v&aacute;ny během va&scaron;ich dal&scaron;&iacute;ch n&aacute;v&scaron;těv. Cookies použ&iacute;v&aacute;me ke zlep&scaron;en&iacute; funkčnosti na&scaron;ich str&aacute;nek a zjednodu&scaron;en&iacute; va&scaron;&iacute; př&iacute;&scaron;t&iacute; n&aacute;v&scaron;těvy, zejm&eacute;na pak pro tyto činnosti:</p>\r\n\r\n<ul>\r\n	<li>uložen&iacute; předvoleb a nastaven&iacute;, kter&aacute; umožňuj&iacute;, aby na&scaron;e webov&eacute; str&aacute;nky fungovaly spr&aacute;vně,</li>\r\n	<li>přihl&aacute;&scaron;en&iacute; a ověřov&aacute;n&iacute;. Pokud se nechcete st&aacute;le přihla&scaron;ovat a odhla&scaron;ovat, d&iacute;ky cookies nemus&iacute;te,</li>\r\n	<li>zabezpečen&iacute;. Cookies použ&iacute;v&aacute;me k odhalov&aacute;n&iacute; podvodů a zneužit&iacute; na&scaron;ich webov&yacute;ch str&aacute;nek,</li>\r\n	<li>anal&yacute;zy. Pomoc&iacute; cookies shromažďujeme data pro na&scaron;e analytick&eacute; n&aacute;stroje,&nbsp;</li>\r\n	<li>marketing. Cookies využ&iacute;v&aacute;me pro vyhodnocen&iacute; na&scaron;ich marketingov&yacute;ch kampan&iacute; nebo pro osloven&iacute; z&aacute;kazn&iacute;ků,</li>\r\n	<li>soci&aacute;ln&iacute; s&iacute;tě. Někter&yacute; obsah z na&scaron;ich str&aacute;nek můžete sd&iacute;let s va&scaron;imi př&aacute;teli.</li>\r\n</ul>\r\n\r\n<p align=\"JUSTIFY\">\r\n	<br>\r\n	<br>\r\n</p>\r\n\r\n<p align=\"JUSTIFY\"><strong>Navzdory v&yacute;&scaron;e uveden&eacute;mu na z&aacute;kladě souborů cookies v&aacute;s nejsme schopni identifikovat na &uacute;roveň konkr&eacute;tn&iacute; fyzick&eacute; osoby.</strong></p>\r\n\r\n<p align=\"JUSTIFY\"><strong>Jak odm&iacute;tnout použ&iacute;v&aacute;n&iacute; souborů cookies?</strong></p>\r\n\r\n<p align=\"JUSTIFY\">Cookies z va&scaron;eho poč&iacute;tače nebo z jin&eacute;ho zař&iacute;zen&iacute; můžete snadno vymazat pomoc&iacute; va&scaron;eho prohl&iacute;žeče. N&aacute;vod, jak zach&aacute;zet se soubory cookies a jak je odstranit, najdete v nab&iacute;dce &quot;N&aacute;pověda&quot; va&scaron;eho prohl&iacute;žeče. V takov&eacute;m př&iacute;padě je ale možn&eacute;, že se v&aacute;m někter&eacute; č&aacute;sti na&scaron;ich str&aacute;nek nebudou zobrazovat spr&aacute;vně, jejich prohl&iacute;žen&iacute; pro v&aacute;s bude složitěj&scaron;&iacute; a nebude se v&aacute;m zobrazovat nab&iacute;dka v&yacute;robků odpov&iacute;daj&iacute;c&iacute; pr&aacute;vě va&scaron;im potřeb&aacute;m.</p>\r\n\r\n<p align=\"JUSTIFY\">Budete-li použ&iacute;vat na&scaron;e str&aacute;nky beze změny nastaven&iacute;, budeme to považovat za souhlas s použ&iacute;v&aacute;n&iacute;m cookies na na&scaron;ich str&aacute;nk&aacute;ch.</p>\r\n\r\n<p align=\"JUSTIFY\">\r\n	<br>\r\n</p>\r\n\r\n<p><strong><span style=\"font-size: 24px;\">Analytick&eacute; n&aacute;stroje Webu</span></strong></p>\r\n\r\n<p align=\"JUSTIFY\"><strong>Statistick&aacute; data</strong></p>\r\n\r\n<p align=\"JUSTIFY\">Pokud využ&iacute;v&aacute;te na&scaron;e webov&eacute; str&aacute;nky, shromažďujeme statistick&eacute; &uacute;daje o va&scaron;&iacute; aktivitě, kter&eacute; d&aacute;le využ&iacute;v&aacute;me ke zlep&scaron;en&iacute; na&scaron;ich služeb.</p>\r\n\r\n<p align=\"JUSTIFY\"><strong>Google Analytics</strong></p>\r\n\r\n<p align=\"JUSTIFY\">Služba, kter&aacute; umožňuje anal&yacute;zu na&scaron;eho webu. Je od společnosti Google Inc. (&bdquo;Google&ldquo;). Informace vygenerovan&eacute; při využ&iacute;v&aacute;n&iacute; na&scaron;eho webu jsou přen&aacute;&scaron;eny na servery společnosti Google, kde jsou n&aacute;sledně uloženy. Společnost Google tyto informace využ&iacute;v&aacute; k anal&yacute;ze uživatelsk&eacute;ho chov&aacute;n&iacute; na na&scaron;em webu a tuto anal&yacute;zu n&aacute;m n&aacute;sledně poskytuje.</p>\r\n\r\n<p align=\"JUSTIFY\"><strong>Sklik, Adwords</strong></p>\r\n\r\n<p align=\"JUSTIFY\">Tyto služby jsou marketingov&eacute; n&aacute;stroje, kter&eacute; n&aacute;m umožňuj&iacute; nab&iacute;zet na&scaron;e služby nov&yacute;m nebo st&aacute;vaj&iacute;c&iacute;m z&aacute;kazn&iacute;kům. Poskytuj&iacute; je společnosti Google nebo Seznam. Aby služby fungovali spr&aacute;vně, využ&iacute;vaj&iacute; cookies.</p>'),
	(5078,'<p align=\"JUSTIFY\">Holding Adastra Group a společnost ADASTRA, s.r.o., kter&aacute; je provozovatelem webu <a href=\"http://www.adastra.cz\">www.adastra.cz</a>, považuje ochranu a důvěrnost va&scaron;ich &uacute;dajů za velmi důležitou. Va&scaron;e osobn&iacute; &uacute;daje zpracov&aacute;v&aacute;me a využ&iacute;v&aacute;me v&nbsp;souladu&nbsp;jak s&nbsp;ustanoven&iacute;mi Česk&yacute;ch pr&aacute;vn&iacute;ch předpisů (z&aacute;kon o ochraně osobn&iacute;ch &uacute;dajů č. 110/2019 Sb.), tak i Evropskou legislativou (Nař&iacute;zen&iacute; Evropsk&eacute;ho parlamentu a Rady (EU) 2016/679).</p>\r\n\r\n<p align=\"JUSTIFY\">\r\n	<br>\r\n</p>\r\n\r\n<p align=\"JUSTIFY\"><strong><span style=\"font-size: 24px;\">Spr&aacute;vce osobn&iacute;ch &uacute;dajů</span></strong></p>\r\n\r\n<p align=\"JUSTIFY\">Spr&aacute;vcem osobn&iacute;ch &uacute;dajů ve smyslu n&aacute;rodn&iacute; a evropsk&eacute; legislativy je:</p>\r\n\r\n<p align=\"JUSTIFY\">ADASTRA, s.r.o.</p>\r\n\r\n<p align=\"JUSTIFY\">Bene&scaron;ovsk&aacute; 1926/8</p>\r\n\r\n<p align=\"JUSTIFY\">Praha 10, 101 00</p>\r\n\r\n<p align=\"JUSTIFY\">IČ: 26202981 DIČ: CZ26202981</p>\r\n\r\n<p align=\"JUSTIFY\">M&aacute;te-li jak&eacute;koli dotazy ohledně zpracov&aacute;n&iacute; a ochrany va&scaron;ich osobn&iacute;ch &uacute;dajů, můžete n&aacute;s kontaktovat e-mailem na adrese: <a href=\"mailto:GDPRCZ@adastragrp.com\">GDPRCZ@adastragrp.com</a>.</p>\r\n\r\n<p align=\"JUSTIFY\">&nbsp;</p>\r\n\r\n<p align=\"JUSTIFY\"><strong><span style=\"font-size: 24px;\">Jak&eacute; osobn&iacute; &uacute;daje zpracov&aacute;v&aacute;me a proč</span></strong></p>\r\n\r\n<p align=\"JUSTIFY\">Největ&scaron;&iacute; č&aacute;st osobn&iacute;ch &uacute;dajů, kter&eacute; zpracov&aacute;v&aacute;me o na&scaron;ich z&aacute;kazn&iacute;c&iacute;ch, dodavatel&iacute;ch a jin&yacute;ch obchodn&iacute;ch stran&aacute;ch, vedeme v souvislosti <strong>s&nbsp;nab&iacute;dkou a poskytov&aacute;n&iacute;m na&scaron;ich služeb</strong> (konzultačn&iacute; činnost v oblasti Information Managementu). V drtiv&eacute; vět&scaron;ině př&iacute;padů se jedn&aacute; o z&aacute;kladn&iacute; kontaktn&iacute; &uacute;daje typu <em>jm&eacute;no, př&iacute;jmen&iacute;, telefon a email</em>. Bez těchto &uacute;dajů s V&aacute;mi logicky nemůžeme komunikovat a tedy zajistit plněn&iacute; na&scaron;ich služeb, kter&eacute; plyne z ř&aacute;dně uzavřen&eacute; <strong>smlouvy</strong>.</p>\r\n\r\n<p align=\"JUSTIFY\"><strong>Pr&aacute;vn&iacute; předpisy a legislativa ČR</strong> n&aacute;m takt&eacute;ž v určit&yacute;ch př&iacute;padech d&aacute;vaj&iacute; povinnost Va&scaron;e osobn&iacute; &uacute;daje zpracov&aacute;vat. Jedn&aacute; se typicky o uchov&aacute;n&iacute; &uacute;dajů dle z&aacute;konn&yacute;ch požadavků z důvodu <strong>veden&iacute;</strong> <strong>&uacute;četnictv&iacute;</strong>.</p>\r\n\r\n<p align=\"JUSTIFY\">Jste-li uchazeč o zaměstn&aacute;n&iacute;, budeme někter&eacute; Va&scaron;e osobn&iacute; &uacute;daje zpracov&aacute;vat pro na&scaron;i potřebu při <strong>n&aacute;boru zaměstnanců</strong> a to proto, abychom s V&aacute;mi popř&iacute;padě mohli podepsat pracovn&iacute; <strong>smlouvu</strong>.</p>\r\n\r\n<p align=\"JUSTIFY\">S Va&scaron;&iacute;m <strong>souhlasem</strong>, jste-li uchazeč o zaměstn&aacute;n&iacute;, archivujeme n&aacute;borovou dokumentaci do odvol&aacute;n&iacute; souhlasu pro potřeby potenci&aacute;ln&iacute; komunikace a <strong>nab&iacute;dky zaměstn&aacute;n&iacute;</strong> u společnosti.</p>\r\n\r\n<p align=\"JUSTIFY\">Na&scaron;im aktivn&iacute;m z&aacute;kazn&iacute;kům si dovolujeme zas&iacute;lat <strong>obchodn&iacute; sdělen&iacute;</strong> s nab&iacute;dkou na&scaron;ich služeb a informacemi o na&scaron;ich produktech na z&aacute;kladě na&scaron;eho <strong>z&aacute;jmu</strong> nab&iacute;zet z&aacute;kazn&iacute;kům vždy aktu&aacute;ln&iacute; a nejlep&scaron;&iacute; technick&eacute; ře&scaron;en&iacute;.</p>\r\n\r\n<p align=\"JUSTIFY\">Mimo v&yacute;&scaron;e zm&iacute;něn&aacute; zpracov&aacute;n&iacute; pořizujeme <strong>videoz&aacute;znam</strong> z na&scaron;eho kamerov&eacute;ho syst&eacute;mu. Čin&iacute;me tak z důvodu <strong>ochrany na&scaron;eho majetku</strong>. Tyto z&aacute;znamy nikdo aktivně nesleduje - mohou b&yacute;t využity až v&nbsp;př&iacute;padě bezpečnostn&iacute;ho incidentu jako důkazn&iacute; materi&aacute;l a jsou archivov&aacute;ny nejd&eacute;le po dobu 14 dnů na na&scaron;em serveru.</p>\r\n\r\n<p align=\"JUSTIFY\">V př&iacute;padě, že jste n&aacute;&scaron; potenci&aacute;ln&iacute; z&aacute;kazn&iacute;k a udělil(a) jste n&aacute;m souhlas, zpracov&aacute;v&aacute;me va&scaron;e osobn&iacute; &uacute;daje k &uacute;čelům zas&iacute;l&aacute;n&iacute; obchodn&iacute;ch sdělen&iacute; - zejm&eacute;na zas&iacute;l&aacute;n&iacute; mailov&eacute;ho osloven&iacute;.</p>\r\n\r\n<p align=\"JUSTIFY\">V&scaron;echny v&yacute;&scaron;e zm&iacute;něn&eacute; osobn&iacute; &uacute;daje, kter&eacute; vznikaj&iacute; z&nbsp;podnětu na&scaron;&iacute; vz&aacute;jemn&eacute; komunikace a interakce, jsou ř&iacute;zeny intern&iacute;m syst&eacute;mem ochrany osobn&iacute;ch &uacute;dajů dle platn&eacute; legislativy. V&nbsp;maxim&aacute;ln&iacute; m&iacute;ře tedy ř&iacute;d&iacute;me př&iacute;stup k&nbsp;osobn&iacute;m &uacute;dajům, technick&aacute; opatřen&iacute; pro jejich zabezpečen&iacute; a dobu jejich existence.</p>\r\n\r\n<p align=\"JUSTIFY\">\r\n	<br>\r\n</p>\r\n\r\n<p align=\"JUSTIFY\"><strong><span style=\"font-size: 24px;\">Doba, po kterou va&scaron;e osobn&iacute; &uacute;daje zpracov&aacute;v&aacute;me</span></strong></p>\r\n\r\n<p align=\"JUSTIFY\">Osobn&iacute; &uacute;daje z&aacute;kazn&iacute;ků a třet&iacute;ch stran zpracov&aacute;v&aacute;me a uchov&aacute;v&aacute;me po dobu nezbytně nutnou k zaji&scaron;těn&iacute; v&scaron;ech pr&aacute;v a povinnost&iacute; plynouc&iacute;ch ze smlouvy, a d&aacute;le po dobu, po kterou jsme povinn&iacute; &uacute;daje uchov&aacute;vat podle obecně z&aacute;vazn&yacute;ch pr&aacute;vn&iacute;ch předpisů.</p>\r\n\r\n<p align=\"JUSTIFY\">Va&scaron;e osobn&iacute; &uacute;daje z&iacute;skan&eacute; na z&aacute;kladě dobrovoln&eacute;ho souhlasu za &uacute;čelem zas&aacute;l&aacute;n&iacute; obchodn&iacute;ch sdělen&iacute; zpracov&aacute;v&aacute;me do odvol&aacute;n&iacute;&nbsp;Va&scaron;eho souhlasu.</p>\r\n\r\n<p align=\"JUSTIFY\">\r\n	<br>\r\n</p>\r\n\r\n<p align=\"JUSTIFY\"><strong><span style=\"font-size: 24px;\">Va&scaron;e pr&aacute;va&nbsp;</span></strong></p>\r\n\r\n<p align=\"JUSTIFY\">Va&scaron;&iacute;m přirozen&yacute;m pr&aacute;vem je obdržet informace o va&scaron;ich datech, kter&eacute; o v&aacute;s zpracov&aacute;v&aacute;me. Stejně tak m&aacute;te pr&aacute;vo na opravu nebo zablokov&aacute;n&iacute; nespr&aacute;vn&yacute;ch či neaktu&aacute;ln&iacute;ch &uacute;dajů, pr&aacute;vo na omezen&iacute; zpracov&aacute;n&iacute; a pr&aacute;vo vzn&eacute;st n&aacute;mitku proti zpracov&aacute;n&iacute;. V&nbsp;určit&yacute;ch př&iacute;padech v&aacute;m n&aacute;lež&iacute; pr&aacute;vo na v&yacute;maz. D&aacute;le jsme povinni va&scaron;e osobn&iacute; &uacute;daje na va&scaron;e pož&aacute;d&aacute;n&iacute; přen&eacute;st na v&aacute;mi zvolen&eacute;ho spr&aacute;vce/zpracovatele osobn&iacute;ch &uacute;dajů.</p>\r\n\r\n<p align=\"JUSTIFY\">Pokud jste n&aacute;m dali souhlas se zpracov&aacute;n&iacute;m va&scaron;ich osobn&iacute;ch &uacute;dajů za &uacute;čelem zas&iacute;l&aacute;n&iacute; obchodn&iacute;ch sdělen&iacute; či osloven&iacute; s potenci&aacute;ln&iacute; pracovn&iacute; nab&iacute;dkou, pak m&aacute;te možnost tento souhlas kdykoliv odvolat. Stač&iacute; n&aacute;s kontaktovat na <a href=\"mailto:GDPRCZ@adastragrp.com\">GDPRCZ@adastragrp.com</a>.</p>\r\n\r\n<p align=\"JUSTIFY\">Tento kontakt využijte i v&nbsp;př&iacute;padech pokud se budete cht&iacute;t zeptat na cokoliv, co se t&yacute;če na&scaron;eho zpracov&aacute;n&iacute; osobn&iacute;ch &uacute;dajů.</p>\r\n\r\n<p align=\"JUSTIFY\">Jste-li přesvědčen&iacute;, že s&nbsp;va&scaron;imi daty nezach&aacute;z&iacute;me adekv&aacute;tně a podle z&aacute;konn&yacute;ch norem, m&aacute;te možnost podat st&iacute;žnost u dozorov&eacute;ho &uacute;řadu, kter&yacute;m je &Uacute;řad pro ochranu osobn&iacute;ch &uacute;dajů.</p>\r\n\r\n<p align=\"JUSTIFY\">\r\n	<br>\r\n</p>\r\n\r\n<p align=\"JUSTIFY\"><strong><span style=\"font-size: 24px;\">Dobrovolnost udělen&iacute; souhlasu</span></strong></p>\r\n\r\n<p align=\"JUSTIFY\">Udělen&iacute; souhlasu se zpracov&aacute;n&iacute;m osobn&iacute;ch &uacute;dajů je zcela dobrovoln&eacute; a nepodmiňuje ž&aacute;dn&eacute; jin&eacute; plněn&iacute; ze strany společnosti ADASTRA, s r.o.</p>\r\n\r\n<p align=\"JUSTIFY\">\r\n	<br>\r\n</p>\r\n\r\n<p align=\"JUSTIFY\"><strong><span style=\"font-size: 24px;\">Přenos osobn&iacute;ch &uacute;dajů</span></strong></p>\r\n\r\n<p align=\"JUSTIFY\"><strong>Ve&scaron;ker&eacute; osobn&iacute; &uacute;daje</strong> z&iacute;skan&eacute; od z&aacute;kazn&iacute;ků a třet&iacute;ch stran <strong>využ&iacute;v&aacute;me v&yacute;hradně pro vnitřn&iacute; potřebu</strong> společnosti, chr&aacute;n&iacute;me před zneužit&iacute;m <strong>a neposkytujeme třet&iacute;m stran&aacute;m&nbsp;</strong>bez předchoz&iacute;ho upozorněn&iacute; nebo souhlasu.</p>\r\n\r\n<p align=\"JUSTIFY\">V&yacute;jimku představuj&iacute; entity holdingu Adastra Group, extern&iacute; společnosti, kter&eacute; pro n&aacute;s zaji&scaron;ťuj&iacute; podpůrn&eacute; služby a org&aacute;ny st&aacute;tn&iacute; moci. Těmto entit&aacute;m va&scaron;e osobn&iacute; &uacute;daje poskytnout můžeme či mus&iacute;me v minim&aacute;ln&iacute;m rozsahu př&iacute;kladově při:</p>\r\n\r\n<ul>\r\n	<li>vy&scaron;etřov&aacute;n&iacute; nez&aacute;konn&eacute;ho využ&iacute;v&aacute;n&iacute; na&scaron;ich služeb nebo pro potřeby soudn&iacute;ho ř&iacute;zen&iacute;, mohou b&yacute;t &uacute;daje před&aacute;ny org&aacute;nům pro vy&scaron;etřov&aacute;n&iacute; trestn&eacute; činnosti.</li>\r\n	<li>spr&aacute;vě na&scaron;ich informačn&iacute;ch syst&eacute;mů a aplikac&iacute;.</li>\r\n</ul>\r\n\r\n<p align=\"JUSTIFY\">U v&scaron;ech těchto poskytovatelů služeb smluvně požadujeme (mimo org&aacute;ny veřejn&eacute; spr&aacute;vy), aby zpracov&aacute;vali va&scaron;e osobn&iacute; &uacute;daje v&nbsp;souladu s&nbsp;podm&iacute;nkami ochrany osobn&iacute;ch &uacute;dajů a platnou legislativou.</p>\r\n\r\n<p align=\"JUSTIFY\">\r\n	<br>\r\n</p>\r\n\r\n<p align=\"JUSTIFY\"><strong><span style=\"font-size: 24px;\">Cookies</span></strong></p>\r\n\r\n<p align=\"JUSTIFY\">Cookies jsou mal&eacute; textov&eacute; soubory, kter&eacute; se ukl&aacute;daj&iacute; ve va&scaron;em zař&iacute;zen&iacute; (poč&iacute;tač, mobiln&iacute; zař&iacute;zen&iacute; nebo jin&eacute;m př&iacute;stroji umožňuj&iacute;c&iacute; př&iacute;stup k internetu) pomoc&iacute; něhož použ&iacute;v&aacute;te e-shop Activacek.cz a pokud je po opu&scaron;těn&iacute; na&scaron;ich str&aacute;nek nesmažete, jsou opět využ&iacute;v&aacute;ny během va&scaron;ich dal&scaron;&iacute;ch n&aacute;v&scaron;těv. Cookies použ&iacute;v&aacute;me ke zlep&scaron;en&iacute; funkčnosti na&scaron;ich str&aacute;nek a zjednodu&scaron;en&iacute; va&scaron;&iacute; př&iacute;&scaron;t&iacute; n&aacute;v&scaron;těvy, zejm&eacute;na pak pro tyto činnosti:</p>\r\n\r\n<ul>\r\n	<li>uložen&iacute; předvoleb a nastaven&iacute;, kter&aacute; umožňuj&iacute;, aby na&scaron;e webov&eacute; str&aacute;nky fungovaly spr&aacute;vně,</li>\r\n	<li>přihl&aacute;&scaron;en&iacute; a ověřov&aacute;n&iacute;. Pokud se nechcete st&aacute;le přihla&scaron;ovat a odhla&scaron;ovat, d&iacute;ky cookies nemus&iacute;te,</li>\r\n	<li>zabezpečen&iacute;. Cookies použ&iacute;v&aacute;me k odhalov&aacute;n&iacute; podvodů a zneužit&iacute; na&scaron;ich webov&yacute;ch str&aacute;nek,</li>\r\n	<li>anal&yacute;zy. Pomoc&iacute; cookies shromažďujeme data pro na&scaron;e analytick&eacute; n&aacute;stroje,&nbsp;</li>\r\n	<li>marketing. Cookies využ&iacute;v&aacute;me pro vyhodnocen&iacute; na&scaron;ich marketingov&yacute;ch kampan&iacute; nebo pro osloven&iacute; z&aacute;kazn&iacute;ků,</li>\r\n	<li>soci&aacute;ln&iacute; s&iacute;tě. Někter&yacute; obsah z na&scaron;ich str&aacute;nek můžete sd&iacute;let s va&scaron;imi př&aacute;teli.</li>\r\n</ul>\r\n\r\n<p align=\"JUSTIFY\">\r\n	<br>\r\n	<br>\r\n</p>\r\n\r\n<p align=\"JUSTIFY\"><strong>Navzdory v&yacute;&scaron;e uveden&eacute;mu na z&aacute;kladě souborů cookies v&aacute;s nejsme schopni identifikovat na &uacute;roveň konkr&eacute;tn&iacute; fyzick&eacute; osoby.</strong></p>\r\n\r\n<p align=\"JUSTIFY\"><strong>Jak odm&iacute;tnout použ&iacute;v&aacute;n&iacute; souborů cookies?</strong></p>\r\n\r\n<p align=\"JUSTIFY\">Cookies z va&scaron;eho poč&iacute;tače nebo z jin&eacute;ho zař&iacute;zen&iacute; můžete snadno vymazat pomoc&iacute; va&scaron;eho prohl&iacute;žeče. N&aacute;vod, jak zach&aacute;zet se soubory cookies a jak je odstranit, najdete v nab&iacute;dce &quot;N&aacute;pověda&quot; va&scaron;eho prohl&iacute;žeče. V takov&eacute;m př&iacute;padě je ale možn&eacute;, že se v&aacute;m někter&eacute; č&aacute;sti na&scaron;ich str&aacute;nek nebudou zobrazovat spr&aacute;vně, jejich prohl&iacute;žen&iacute; pro v&aacute;s bude složitěj&scaron;&iacute; a nebude se v&aacute;m zobrazovat nab&iacute;dka v&yacute;robků odpov&iacute;daj&iacute;c&iacute; pr&aacute;vě va&scaron;im potřeb&aacute;m.</p>\r\n\r\n<p align=\"JUSTIFY\">Budete-li použ&iacute;vat na&scaron;e str&aacute;nky beze změny nastaven&iacute;, budeme to považovat za souhlas s použ&iacute;v&aacute;n&iacute;m cookies na na&scaron;ich str&aacute;nk&aacute;ch.</p>\r\n\r\n<p align=\"JUSTIFY\">\r\n	<br>\r\n</p>\r\n\r\n<p><strong><span style=\"font-size: 24px;\">Analytick&eacute; n&aacute;stroje Webu</span></strong></p>\r\n\r\n<p align=\"JUSTIFY\"><strong>Statistick&aacute; data</strong></p>\r\n\r\n<p align=\"JUSTIFY\">Pokud využ&iacute;v&aacute;te na&scaron;e webov&eacute; str&aacute;nky, shromažďujeme statistick&eacute; &uacute;daje o va&scaron;&iacute; aktivitě, kter&eacute; d&aacute;le využ&iacute;v&aacute;me ke zlep&scaron;en&iacute; na&scaron;ich služeb.</p>\r\n\r\n<p align=\"JUSTIFY\"><strong>Google Analytics</strong></p>\r\n\r\n<p align=\"JUSTIFY\">Služba, kter&aacute; umožňuje anal&yacute;zu na&scaron;eho webu. Je od společnosti Google Inc. (&bdquo;Google&ldquo;). Informace vygenerovan&eacute; při využ&iacute;v&aacute;n&iacute; na&scaron;eho webu jsou přen&aacute;&scaron;eny na servery společnosti Google, kde jsou n&aacute;sledně uloženy. Společnost Google tyto informace využ&iacute;v&aacute; k anal&yacute;ze uživatelsk&eacute;ho chov&aacute;n&iacute; na na&scaron;em webu a tuto anal&yacute;zu n&aacute;m n&aacute;sledně poskytuje.</p>\r\n\r\n<p align=\"JUSTIFY\"><strong>Sklik, Adwords</strong></p>\r\n\r\n<p align=\"JUSTIFY\">Tyto služby jsou marketingov&eacute; n&aacute;stroje, kter&eacute; n&aacute;m umožňuj&iacute; nab&iacute;zet na&scaron;e služby nov&yacute;m nebo st&aacute;vaj&iacute;c&iacute;m z&aacute;kazn&iacute;kům. Poskytuj&iacute; je společnosti Google nebo Seznam. Aby služby fungovali spr&aacute;vně, využ&iacute;vaj&iacute; cookies.</p>'),
	(5080,'<p align=\"JUSTIFY\">\r\n	<a name=\"_GoBack\"></a>Adastra Group holding and ADASTRA, s.r.o., operator of the website <a href=\"http://www.adastra.cz\">www.adastra.cz</a>, consider protection and confidentiality of your personal data as very important. We process and use your personal data in compliance with the provisions of Czech legal regulations (Act No. 110/2019 Coll., Personal Data Processing) and European legislation (Regulation (EU) 2016/679 of the European Parliament and of the Council).</p>\r\n\r\n<p align=\"JUSTIFY\">\r\n	<br>\r\n</p>\r\n\r\n<p align=\"JUSTIFY\"><strong><span style=\"font-size: 24px;\">Personal data controller</span></strong></p>\r\n\r\n<p align=\"JUSTIFY\">Personal data controller under national and European legislation is:</p>\r\n\r\n<p align=\"JUSTIFY\">ADASTRA, s.r.o.</p>\r\n\r\n<p align=\"JUSTIFY\">Bene&scaron;ovsk&aacute; 1926/8</p>\r\n\r\n<p align=\"JUSTIFY\">Prague 10, 101 00</p>\r\n\r\n<p align=\"JUSTIFY\">Business ID No.: 26202981 Tax ID No.: CZ26202981</p>\r\n\r\n<p align=\"JUSTIFY\">Should you have any queries regarding processing and protection of your personal data, feel free to contact us by e-mail at: <a href=\"mailto:GDPRCZ@adastragrp.com\">GDPRCZ@adastragrp.com</a>.</p>\r\n\r\n<p align=\"JUSTIFY\">&nbsp;</p>\r\n\r\n<p align=\"JUSTIFY\"><strong><span style=\"font-size: 24px;\">Which personal data do we process and why?</span></strong></p>\r\n\r\n<p align=\"JUSTIFY\">Majority of personal data that we process regarding our customers, suppliers and other business partners are kept in relation to <strong>the offer and provision of our services</strong> (consultancy in Information Management). In vast majority of cases, this is basic contact information, such as <em>name, surname, telephone and e-mail</em>. Logically, we cannot communicate with you without these data and could not thus ensure performance of our services under a duly concluded <strong>contract</strong>.</p>\r\n\r\n<p align=\"JUSTIFY\"><strong>Legal regulations and legislation of the Czech Republic</strong> also stipulate our obligation to process your personal data in some cases. Typically, it is data retention in line with statutory requirements because of <strong>bookkeeping</strong>.</p>\r\n\r\n<p align=\"JUSTIFY\">If you apply for a job, we will process some of your personal data for our use in <strong>recruitment</strong> so that we could, if need be, sign a <strong>contract of employment</strong> with you.</p>\r\n\r\n<p align=\"JUSTIFY\">If you give us <strong>consent</strong> as a job applicant, we archive the recruitment documentation until consent withdrawal for the purposes of potential communication and provision of <strong>job offers</strong> in relation to our company.</p>\r\n\r\n<p align=\"JUSTIFY\">We also send <strong>commercial messages</strong> offering our services and product information to our active customers in line with our <strong>interest</strong> to always offer customers most up-to-date and top technical solutions.</p>\r\n\r\n<p align=\"JUSTIFY\">Besides the aforementioned processing, we also take <strong>video footage</strong> from our CCTV system. It is because we want to <strong>protect our property</strong>. These recordings are not actively monitored. They can be used only in case of a security incident as documentary evidence and are archived on our server for the period of 14 days at maximum.</p>\r\n\r\n<p align=\"JUSTIFY\">If you are our potential customer and you have granted consent to us, we process your personal data for the purpose of sending commercial messages, especially e-mail solicitation.</p>\r\n\r\n<p align=\"JUSTIFY\">All the above mentioned personal data which are rendered due to our mutual communication and interaction are controlled by our internal system of personal data protection in accordance with applicable legislation. We thus control access to personal data, technical security measures and the period of their existence to a maximum extent.</p>\r\n\r\n<p align=\"JUSTIFY\">\r\n	<br>\r\n</p>\r\n\r\n<p align=\"JUSTIFY\"><strong><span style=\"font-size: 24px;\">Period for which we process your personal data</span></strong></p>\r\n\r\n<p align=\"JUSTIFY\">We process and retain personal data of customers and third parties for the period strictly necessary to ensure all the rights and obligations arising from the contract, and also for the period for which we are required to retain data in accordance with generally binding legal regulations.</p>\r\n\r\n<p align=\"JUSTIFY\">We process your personal data acquired on the basis of your voluntary consent for the purpose of sending commercial messages until you choose to withdraw your consent.</p>\r\n\r\n<p align=\"JUSTIFY\">\r\n	<br>\r\n</p>\r\n\r\n<p align=\"JUSTIFY\"><strong><span style=\"font-size: 24px;\">Your rights&nbsp;</span></strong></p>\r\n\r\n<p align=\"JUSTIFY\">You have the natural right to receive information about your data that we process. Likewise, you have the right to have your incorrect or obsolete data corrected or blocked, a right to restrict processing and a right to object to processing. In some cases, you have the right to erasure. We are also obliged to transfer your personal data, upon your request, to your personal data controller/processor of your choice.</p>\r\n\r\n<p align=\"JUSTIFY\">If you have given us consent to the processing of your personal data for the purpose of sending commercial messages or solicitation with a potential job offer, you have the option to withdraw such consent at any time. Simply contact us at <a href=\"mailto:GDPRCZ@adastragrp.com\">GDPRCZ@adastragrp.com</a>.</p>\r\n\r\n<p align=\"JUSTIFY\">You can also use this contact if you would like to ask anything regarding our personal data processing.</p>\r\n\r\n<p align=\"JUSTIFY\">If you are convinced that we do not treat your data adequately and in compliance with legal regulations, you can lodge a complaint with a supervisory authority, which is the Office for Personal Data Protection.</p>\r\n\r\n<p align=\"JUSTIFY\">\r\n	<br>\r\n</p>\r\n\r\n<p align=\"JUSTIFY\"><strong><span style=\"font-size: 24px;\">You give your consent voluntarily</span></strong></p>\r\n\r\n<p align=\"JUSTIFY\">You give your consent to processing of your personal data entirely voluntarily and it is not a precondition of any performance by ADASTRA, s.r.o.</p>\r\n\r\n<p align=\"JUSTIFY\">\r\n	<br>\r\n</p>\r\n\r\n<p align=\"JUSTIFY\"><strong><span style=\"font-size: 24px;\">Personal data transfer</span></strong></p>\r\n\r\n<p align=\"JUSTIFY\"><strong>All personal data</strong> obtained from customers and third parties <strong>are used exclusively for internal use of</strong> the company; we protect them against abuse <strong>and we do not provide them to third parties&nbsp;</strong>without prior notice or consent.</p>\r\n\r\n<p align=\"JUSTIFY\">The only exceptions to the rule above are: the entities of Adastra Group holding, external companies providing support services for us, and the state authorities. We may or are obliged to provide your personal data to these entities to the minimum extent, for example, for the following purposes:</p>\r\n\r\n<ul>\r\n	<li>Data can be transferred to law enforcement authorities in case of investigation of unlawful use of our services or for the needs of court proceedings;</li>\r\n	<li>Administration of our information systems and applications.</li>\r\n</ul>\r\n\r\n<p align=\"JUSTIFY\">All of these service providers (except for public administration authorities) are bound by contracts to process your personal data in accordance with the terms of the privacy policy and the applicable legislation.</p>\r\n\r\n<p align=\"JUSTIFY\">\r\n	<br>\r\n</p>\r\n\r\n<p align=\"JUSTIFY\"><strong><span style=\"font-size: 24px;\">Cookies</span></strong></p>\r\n\r\n<p align=\"JUSTIFY\">Cookies are small text files that are stored on your device (computer, mobile device or another device allowing for an access to the internet) used for accessing Activacek.cz e-shop. If you don&rsquo;t delete them when leaving our website, they are used again during your next visits. Cookies are used by us to enhance the functionality of our website and making things easier during your next visit, namely for the following activities:</p>\r\n\r\n<ul>\r\n	<li>Saving of preferences and settings which make our website function correctly.</li>\r\n	<li>Log-ins and authentication. If you don&rsquo;t &nbsp; &nbsp; want to keep logging in and logging out, you don&rsquo;t have to thanks to cookies.</li>\r\n	<li>Security. We use cookies to detect fraud and abuse of our website.</li>\r\n	<li>Analyses. We use cookies to collect data for our analytic tools.</li>\r\n	<li>Marketing. Cookies are used to evaluate our marketing campaigns or to address customers.</li>\r\n	<li>Social media. You can share some of the content from our website with your friends.</li>\r\n</ul>\r\n\r\n<p align=\"JUSTIFY\">\r\n	<br>\r\n	<br>\r\n</p>\r\n\r\n<p align=\"JUSTIFY\"><strong>Regardless of the above said, we are not able to identify you at the level of a specific natural person on the basis of cookies.</strong></p>\r\n\r\n<p align=\"JUSTIFY\"><strong>How can you refuse the use of cookies?</strong></p>\r\n\r\n<p align=\"JUSTIFY\">Cookies can be easily deleted from your computer or another device by means of your browser. For instructions how to handle and delete cookies go to the Help menu of your browser. It is possible that due to deleting the cookies some parts of our website will not be displayed correctly or browsing them may be more difficult for you and you may not be displayed the offer of products corresponding to your personal needs.</p>\r\n\r\n<p align=\"JUSTIFY\">If you use our website without altering the settings, we will consider it as your consenting to the use of cookies on our website.</p>\r\n\r\n<p align=\"JUSTIFY\">\r\n	<br>\r\n</p>\r\n\r\n<p><strong><span style=\"font-size: 24px;\">Analytic web tools</span></strong></p>\r\n\r\n<p align=\"JUSTIFY\"><strong>Statistical data</strong></p>\r\n\r\n<p align=\"JUSTIFY\">If you use our website, we collect statistical data on your activities, which are further used for improvement of our services.</p>\r\n\r\n<p align=\"JUSTIFY\"><strong>Google Analytics</strong></p>\r\n\r\n<p align=\"JUSTIFY\">Service enabling us to analyse our website. It is made by Google Inc. (&ldquo;Google&rdquo;). Information generated during the use of our website is transferred to Google servers where it is subsequently stored. Google uses these data to analyse user behaviour on our website and then provides us with such analysis.</p>\r\n\r\n<p align=\"JUSTIFY\"><strong>Sklik, Adwords</strong></p>\r\n\r\n<p align=\"JUSTIFY\">These services are marketing tools allowing for offering our services to both new and existing customers. They are provided by Google or Seznam. These services use cookies to function properly.</p>'),
	(5082,'<p align=\"JUSTIFY\">\r\n	<a name=\"_GoBack\"></a>Adastra Group holding and ADASTRA, s.r.o., operator of the website <a href=\"http://www.adastra.cz\">www.adastra.cz</a>, consider protection and confidentiality of your personal data as very important. We process and use your personal data in compliance with the provisions of Czech legal regulations (Act No. 110/2019 Coll., Personal Data Processing) and European legislation (Regulation (EU) 2016/679 of the European Parliament and of the Council).</p>\r\n\r\n<p align=\"JUSTIFY\">\r\n	<br>\r\n</p>\r\n\r\n<p align=\"JUSTIFY\"><strong><span style=\"font-size: 24px;\">Personal data controller</span></strong></p>\r\n\r\n<p align=\"JUSTIFY\">Personal data controller under national and European legislation is:</p>\r\n\r\n<p align=\"JUSTIFY\">ADASTRA, s.r.o.</p>\r\n\r\n<p align=\"JUSTIFY\">Bene&scaron;ovsk&aacute; 1926/8</p>\r\n\r\n<p align=\"JUSTIFY\">Prague 10, 101 00</p>\r\n\r\n<p align=\"JUSTIFY\">Business ID No.: 26202981 Tax ID No.: CZ26202981</p>\r\n\r\n<p align=\"JUSTIFY\">Should you have any queries regarding processing and protection of your personal data, feel free to contact us by e-mail at: <a href=\"mailto:GDPRCZ@adastragrp.com\">GDPRCZ@adastragrp.com</a>.</p>\r\n\r\n<p align=\"JUSTIFY\">&nbsp;</p>\r\n\r\n<p align=\"JUSTIFY\"><strong><span style=\"font-size: 24px;\">Which personal data do we process and why?</span></strong></p>\r\n\r\n<p align=\"JUSTIFY\">Majority of personal data that we process regarding our customers, suppliers and other business partners are kept in relation to <strong>the offer and provision of our services</strong> (consultancy in Information Management). In vast majority of cases, this is basic contact information, such as <em>name, surname, telephone and e-mail</em>. Logically, we cannot communicate with you without these data and could not thus ensure performance of our services under a duly concluded <strong>contract</strong>.</p>\r\n\r\n<p align=\"JUSTIFY\"><strong>Legal regulations and legislation of the Czech Republic</strong> also stipulate our obligation to process your personal data in some cases. Typically, it is data retention in line with statutory requirements because of <strong>bookkeeping</strong>.</p>\r\n\r\n<p align=\"JUSTIFY\">If you apply for a job, we will process some of your personal data for our use in <strong>recruitment</strong> so that we could, if need be, sign a <strong>contract of employment</strong> with you.</p>\r\n\r\n<p align=\"JUSTIFY\">If you give us <strong>consent</strong> as a job applicant, we archive the recruitment documentation until consent withdrawal for the purposes of potential communication and provision of <strong>job offers</strong> in relation to our company.</p>\r\n\r\n<p align=\"JUSTIFY\">We also send <strong>commercial messages</strong> offering our services and product information to our active customers in line with our <strong>interest</strong> to always offer customers most up-to-date and top technical solutions.</p>\r\n\r\n<p align=\"JUSTIFY\">Besides the aforementioned processing, we also take <strong>video footage</strong> from our CCTV system. It is because we want to <strong>protect our property</strong>. These recordings are not actively monitored. They can be used only in case of a security incident as documentary evidence and are archived on our server for the period of 14 days at maximum.</p>\r\n\r\n<p align=\"JUSTIFY\">If you are our potential customer and you have granted consent to us, we process your personal data for the purpose of sending commercial messages, especially e-mail solicitation.</p>\r\n\r\n<p align=\"JUSTIFY\">All the above mentioned personal data which are rendered due to our mutual communication and interaction are controlled by our internal system of personal data protection in accordance with applicable legislation. We thus control access to personal data, technical security measures and the period of their existence to a maximum extent.</p>\r\n\r\n<p align=\"JUSTIFY\">\r\n	<br>\r\n</p>\r\n\r\n<p align=\"JUSTIFY\"><strong><span style=\"font-size: 24px;\">Period for which we process your personal data</span></strong></p>\r\n\r\n<p align=\"JUSTIFY\">We process and retain personal data of customers and third parties for the period strictly necessary to ensure all the rights and obligations arising from the contract, and also for the period for which we are required to retain data in accordance with generally binding legal regulations.</p>\r\n\r\n<p align=\"JUSTIFY\">We process your personal data acquired on the basis of your voluntary consent for the purpose of sending commercial messages until you choose to withdraw your consent.</p>\r\n\r\n<p align=\"JUSTIFY\">\r\n	<br>\r\n</p>\r\n\r\n<p align=\"JUSTIFY\"><strong><span style=\"font-size: 24px;\">Your rights&nbsp;</span></strong></p>\r\n\r\n<p align=\"JUSTIFY\">You have the natural right to receive information about your data that we process. Likewise, you have the right to have your incorrect or obsolete data corrected or blocked, a right to restrict processing and a right to object to processing. In some cases, you have the right to erasure. We are also obliged to transfer your personal data, upon your request, to your personal data controller/processor of your choice.</p>\r\n\r\n<p align=\"JUSTIFY\">If you have given us consent to the processing of your personal data for the purpose of sending commercial messages or solicitation with a potential job offer, you have the option to withdraw such consent at any time. Simply contact us at <a href=\"mailto:GDPRCZ@adastragrp.com\">GDPRCZ@adastragrp.com</a>.</p>\r\n\r\n<p align=\"JUSTIFY\">You can also use this contact if you would like to ask anything regarding our personal data processing.</p>\r\n\r\n<p align=\"JUSTIFY\">If you are convinced that we do not treat your data adequately and in compliance with legal regulations, you can lodge a complaint with a supervisory authority, which is the Office for Personal Data Protection.</p>\r\n\r\n<p align=\"JUSTIFY\">\r\n	<br>\r\n</p>\r\n\r\n<p align=\"JUSTIFY\"><strong><span style=\"font-size: 24px;\">You give your consent voluntarily</span></strong></p>\r\n\r\n<p align=\"JUSTIFY\">You give your consent to processing of your personal data entirely voluntarily and it is not a precondition of any performance by ADASTRA, s.r.o.</p>\r\n\r\n<p align=\"JUSTIFY\">\r\n	<br>\r\n</p>\r\n\r\n<p align=\"JUSTIFY\"><strong><span style=\"font-size: 24px;\">Personal data transfer</span></strong></p>\r\n\r\n<p align=\"JUSTIFY\"><strong>All personal data</strong> obtained from customers and third parties <strong>are used exclusively for internal use of</strong> the company; we protect them against abuse <strong>and we do not provide them to third parties&nbsp;</strong>without prior notice or consent.</p>\r\n\r\n<p align=\"JUSTIFY\">The only exceptions to the rule above are: the entities of Adastra Group holding, external companies providing support services for us, and the state authorities. We may or are obliged to provide your personal data to these entities to the minimum extent, for example, for the following purposes:</p>\r\n\r\n<ul>\r\n	<li>Data can be transferred to law enforcement authorities in case of investigation of unlawful use of our services or for the needs of court proceedings;</li>\r\n	<li>Administration of our information systems and applications.</li>\r\n</ul>\r\n\r\n<p align=\"JUSTIFY\">All of these service providers (except for public administration authorities) are bound by contracts to process your personal data in accordance with the terms of the privacy policy and the applicable legislation.</p>\r\n\r\n<p align=\"JUSTIFY\">\r\n	<br>\r\n</p>\r\n\r\n<p align=\"JUSTIFY\"><strong><span style=\"font-size: 24px;\">Cookies</span></strong></p>\r\n\r\n<p align=\"JUSTIFY\">Cookies are small text files that are stored on your device (computer, mobile device or another device allowing for an access to the internet) used for accessing Activacek.cz e-shop. If you don&rsquo;t delete them when leaving our website, they are used again during your next visits. Cookies are used by us to enhance the functionality of our website and making things easier during your next visit, namely for the following activities:</p>\r\n\r\n<ul>\r\n	<li>Saving of preferences and settings which make our website function correctly.</li>\r\n	<li>Log-ins and authentication. If you don&rsquo;t &nbsp; &nbsp; want to keep logging in and logging out, you don&rsquo;t have to thanks to cookies.</li>\r\n	<li>Security. We use cookies to detect fraud and abuse of our website.</li>\r\n	<li>Analyses. We use cookies to collect data for our analytic tools.</li>\r\n	<li>Marketing. Cookies are used to evaluate our marketing campaigns or to address customers.</li>\r\n	<li>Social media. You can share some of the content from our website with your friends.</li>\r\n</ul>\r\n\r\n<p align=\"JUSTIFY\">\r\n	<br>\r\n	<br>\r\n</p>\r\n\r\n<p align=\"JUSTIFY\"><strong>Regardless of the above said, we are not able to identify you at the level of a specific natural person on the basis of cookies.</strong></p>\r\n\r\n<p align=\"JUSTIFY\"><strong>How can you refuse the use of cookies?</strong></p>\r\n\r\n<p align=\"JUSTIFY\">Cookies can be easily deleted from your computer or another device by means of your browser. For instructions how to handle and delete cookies go to the Help menu of your browser. It is possible that due to deleting the cookies some parts of our website will not be displayed correctly or browsing them may be more difficult for you and you may not be displayed the offer of products corresponding to your personal needs.</p>\r\n\r\n<p align=\"JUSTIFY\">If you use our website without altering the settings, we will consider it as your consenting to the use of cookies on our website.</p>\r\n\r\n<p align=\"JUSTIFY\">\r\n	<br>\r\n</p>\r\n\r\n<p><strong><span style=\"font-size: 24px;\">Analytic web tools</span></strong></p>\r\n\r\n<p align=\"JUSTIFY\"