INSERT INTO `acamar_web_quote` (`cmsplugin_ptr_id`, `title`, `subtitle`, `text`, `author`, `author_title`, `author_image_id`)
VALUES
	(104,'Poznáme, v jaké firmě vám bude dobře.','A když budete něco potřebovat, vyřešíme to klidně na pivu','<p>V každé firmě strávíme nějaký čas, ať poznáme její kulturu, podmínky i tým. Úplně všechno sice zařídit neumíme, ale vždycky hledáme projekt podle vašich požadavků. Chcete home office? Zařídíme to. Chcete si brát do práce psa? Víme, ve kterých firmách to bude v pohodě.</p>\n','Anna Vacíková','Account Manager',210),
	(1171,'We’ll find companies where you’ll feel comfortable working.','And if you need something, we can even talk about it over a glass of beer ','<p>“We spend some time in every company to get to know its culture, conditions, and team. No, we cannot take care of everything, but we always look for a project to match your requirements. Want to work from home? We can set that up. Want to bring your dog to the office? We know companies where it’s not a problem.”</p>\n','Anna Vacíková','Account Manager',210),
	(1266,'Мы выясним, в какой фирме Вы будете чувствовать себя как рыба в воде.','Если Вам что-то понадобится, мы решим все Ваши вопросы в неформальной обстановке за чашкой кофе.','<p>«В каждой фирме мы проводим определённое время, чтобы хорошо узнать её культуру, условия и команду. Сделать за Вас всё мы, конечно, не можем, но всегда ищем предложения, подходящие именно Вам. Предпочитаете работать на дому? Мы подберём для Вас возможные варианты. Хотите брать на работу свою собаку? Мы знаем, в каких фирмах с этим не будет никаких проблем».</p>\n','Анна Вацикова','Account Manager',210),
	(4808,'Poznáme, v jaké firmě vám bude dobře.','A když budete něco potřebovat, vyřešíme to klidně na pivu','<p>V každé firmě strávíme nějaký čas, ať poznáme její kulturu, podmínky i tým. Úplně všechno sice zařídit neumíme, ale vždycky hledáme projekt podle vašich požadavků. Chcete home office? Zařídíme to. Chcete si brát do práce psa? Víme, ve kterých firmách to bude v pohodě.</p>\n','Anna Vacíková','Account Manager',210),
	(4830,'We’ll find companies where you’ll feel comfortable working.','And if you need something, we can even talk about it over a glass of beer ','<p>“We spend some time in every company to get to know its culture, conditions, and team. No, we cannot take care of everything, but we always look for a project to match your requirements. Want to work from home? We can set that up. Want to bring your dog to the office? We know companies where it’s not a problem.”</p>\n','Anna Vacíková','Account Manager',210),
	(5013,'Мы выясним, в какой фирме Вы будете чувствовать себя как рыба в воде.','Если Вам что-то понадобится, мы решим все Ваши вопросы в неформальной обстановке за чашкой кофе.','<p>«В каждой фирме мы проводим определённое время, чтобы хорошо узнать её культуру, условия и команду. Сделать за Вас всё мы, конечно, не можем, но всегда ищем предложения, подходящие именно Вам. Предпочитаете работать на дому? Мы подберём для Вас возможные варианты. Хотите брать на работу свою собаку? Мы знаем, в каких фирмах с этим не будет никаких проблем».</p>\n','Анна Вацикова','Account Manager',210);
