	(2,'Igor Savič, Group Leader v Commerz Systems','Profesionální přístup, rychlá reakce na častou změnu požadovaných profilů, prověření kandidáti, velice příjemná spolupráce. To je Acamar!“',NULL,NULL,0,'Igor Savič, Group Leader v Commerz Systems','','','Profesionální přístup, rychlá reakce na častou změnu požadovaných profilů, prověření kandidáti, velice příjemná spolupráce. To je Acamar!“','',''),
	(3,'Michal Rozehnal, CEO ve firmě Reporting.cz','Pro náš projekt jsme potřebovali lidi, kteří mají kompetence v oblasti analýzy i vývoje. Acamar nám dodal špičkové odborníky, kteří naprosto splňovali naše požadavky.',168,199,1,'Michal Rozehnal, CEO ve firmě Reporting.cz','Michal Rozehnal, CEO at Reporting.cz','Михал Розегнал, CEO в компании «Reporting.cz»','Pro náš projekt jsme potřebovali lidi, kteří mají kompetence v oblasti analýzy i vývoje. Acamar nám dodal špičkové odborníky, kteří naprosto splňovali naše požadavky.','For our project, we needed people, who are competent in the area of analysis and development. Acamar provided us with the best professionals, who absolutely met our requirements. ','Для нашего проекта нам нужны были люди, которые компетентны в области анализа и развития. Компания «Acamar» нам прислала высококвалифицированных специалистов, полностью отвечающих нашим требованиям.'),
	(4,'Martin Hudos, Senior Manager v Deloitte','Spolupráce s Acamarem vždy probíhala na velmi profesionální úrovni. Na čem jsme se domluvili, to platilo. Vždy jsem se na ně mohl spolehnout.',167,70,1,'Martin Hudos, Senior Manager v Deloitte','Martin Hudos, Senior Manager at Deloitte','Мартин Гудос, Старший менеджер компании «Deloitte»','Spolupráce s Acamarem vždy probíhala na velmi profesionální úrovni. Na čem jsme se domluvili, to platilo. Vždy jsem se na ně mohl spolehnout.','Cooperation with Acamar is always on a very professional level. Whatever we agree on is a done deal. I can always rely on them.','Сотрудничество с компанией Acamar всегда проходило на высокопрофессиональном уровне. То, о чем мы договорились, всегда было выполнено. На них я мог положиться.');
