INSERT INTO `acamar_web_workelipsecolumn` (`id`, `title`, `text`, `image_id`, `parent_id`)
VALUES
	(1,'Budeme vás rádi doprovázet celé roky','Ve firmách pomáháme plánovat kapacity na projektech na několik let dopředu. \r\nProto co je v plánu, to se stane.',218,11),
	(2,'Dosáhneme za hranice České republiky','Najdeme experty do mezinárodních týmů. Toho pravého najdeme v zahraničí, pracovat ale bude osobně u vás.',217,11),
	(3,'9/10 našich expertů si firma opravdu vybere','Tak dobrý je náš prescreening. \r\nPropojujeme IT experty a firmy tak, aby si lidé na obou stranách vzájemně sedli.',59,11),
	(52,'We are happy to accompany you for years','We help companies plan project capacities years into the future.\r\nThis means that their plans become reality.',218,1166),
	(53,'We reach beyond the borders of the Czech Republic','We acquire experts for international teams. We find the right people abroad, but they will work personally at your company.',217,1166),
	(54,'Companies really choose 9 out of 10 of our experts','Our pre-screening is that good.\r\nWe connect IT experts and companies so that people on both sides get along.',59,1166),
	(55,'У нас большая база специалистов и фирм и она постоянно расширяется.','Системы сообщают нам, когда Ваша работа или Ваш проект подходит к концу. Мы быстро найдём в фирму сотрудника, который будет работать по контракту, а если вам нужно, то и целую команду.\r\n\r\n',35,1261),
	(56,'Мы сотрудничаем с фирмами и IT-профессионалами за пределами Чешской республики.','Мы найдём специалистов в международные компании\r\nВ Праге, а также в Европе и за её пределами.',27,1261),
	(57,'Мы ведём дела добросоветно и всегда интересуемся сотрудниками, заключившими с нами контракт','Специалисты, которые с нами сотрудничают, считают нас помощниками и даже друзьями.\r\nК каждому специалисту мы находим индивидуальный подход, без которого не представляем свою работу.',24,1261),
	(265,'У нас большая база специалистов и фирм и она постоянно расширяется.','Системы сообщают нам, когда Ваша работа или Ваш проект подходит к концу. Мы быстро найдём в фирму сотрудника, который будет работать по контракту, а если вам нужно, то и целую команду.\r\n\r\n',35,5184),
	(266,'Мы сотрудничаем с фирмами и IT-профессионалами за пределами Чешской республики.','Мы найдём специалистов в международные компании\r\nВ Праге, а также в Европе и за её пределами.',27,5184),
	(267,'Мы ведём дела добросоветно и всегда интересуемся сотрудниками, заключившими с нами контракт','Специалисты, которые с нами сотрудничают, считают нас помощниками и даже друзьями.\r\nК каждому специалисту мы находим индивидуальный подход, без которого не представляем свою работу.',24,5184),
	(271,'We are happy to accompany you for years','We help companies plan project capacities years into the future.\r\nThis means that their plans become reality.',218,5325),
	(272,'We reach beyond the borders of the Czech Republic','We acquire experts for international teams. We find the right people abroad, but they will work personally at your company.',217,5325),
	(273,'Companies really choose 9 out of 10 of our experts','Our pre-screening is that good.\r\nWe connect IT experts and companies so that people on both sides get along.',59,5325),
	(286,'Budeme vás rádi doprovázet celé roky','Ve firmách pomáháme plánovat kapacity na projektech na několik let dopředu. \r\nProto co je v plánu, to se stane.',218,5503),
	(287,'Dosáhneme za hranice České republiky','Najdeme experty do mezinárodních týmů. Toho pravého najdeme v zahraničí, pracovat ale bude osobně u vás.',217,5503),
	(288,'9/10 našich expertů si firma opravdu vybere','Tak dobrý je náš prescreening. \r\nPropojujeme IT experty a firmy tak, aby si lidé na obou stranách vzájemně sedli.',59,5503);
